INSERT INTO "data20220809_printed" VALUES (1, '200032542', 'Assorted Wine Glasses - Made By Design&#153;', 'You’ll love using this 12-ounce Wine Glass from Made By Design™ for any occasion, from wine-and-bubble-bath nights to dinner parties with friends. The simple design makes for a timeless kitchen staple, and the 12-ounce capacity holds just the right amount of your favorite drink. The stem is easy to hold, while the wide bottom keeps the glass sturdily standing as you wine and dine.<br /><br />If you’re not satisfied with any Target Owned Brand item, return it within one year with a receipt for an exchange or a refund.', 'https://target.scene7.com/is/image/Target/GUEST_d51b63f3-f54b-481b-85b0-dd2e7e9830e6', 2.0, 'College', 40.0, 4, 'chanelle');
INSERT INTO "data20220809_printed" VALUES (2, '080066958', 'Motorola Moto 2022 G Power Unlocked (64GB) - Dark Grove', 'With up to three days of battery life, moto g power lets you capture more without stopping to recharge. Tell your story in more creative ways with a 50 MP camera featuring Dual Capture. View games, movies, and video chats on an ultra-wide 6.5'' 90 Hz display. Hold what matters with 64GB of built-in storage. And enjoy the speed of an octa-core processor to power your journeys. ', 'https://target.scene7.com/is/image/Target/GUEST_0166991f-0a84-4e1c-a1fa-bfd6eddb3914', 169.99, 'Electronics', 50.0, 1, 'chanelle');
INSERT INTO "data20220809_printed" VALUES (3, '817513019081', 'Cantu Natural Hair Coconut Curling Cream - 25oz', 'Cantu Shea Butter for Natural Hair Coconut Curling Cream 25 oz delivers lightweight moisture that leaves your curls softer than ever. The award-winning shea butter formula increases manageability, provides ultimate curl definition, and elongates curls without weighing down hair. Perfect for Type 3 and Type 4 curls and coils, the Coconut Curling Cream helps repair dry, brittle hair and conditions to add a natural shine to any curly style. Crafted without harsh ingredients like mineral oil, sulfates, parabens, silicones, phthalates, gluten, paraffin, or propylene, the Coconut Curling Cream is gentle enough for daily use. For best results, apply a generous amount to wet or dry hair, section by section. Style as desired. Since the beginning, you’ve pushed us to advance skin and hair science to honor your locs, your curls, your waves, your braids, your natural. At Cantu, we support your journey with care and we celebrate all the styles you rock!', 'https://target.scene7.com/is/image/Target/GUEST_2ae1b256-f2f7-47b5-aa82-bbdffe5774b1', 12.39, 'Beauty', 40.0, 1, 'chanelle');
INSERT INTO "data20220809_printed" VALUES (4, '817513019081', 'Cantu Natural Hair Coconut Curling Cream - 25oz', 'Cantu Shea Butter for Natural Hair Coconut Curling Cream 25 oz delivers lightweight moisture that leaves your curls softer than ever. The award-winning shea butter formula increases manageability, provides ultimate curl definition, and elongates curls without weighing down hair. Perfect for Type 3 and Type 4 curls and coils, the Coconut Curling Cream helps repair dry, brittle hair and conditions to add a natural shine to any curly style. Crafted without harsh ingredients like mineral oil, sulfates, parabens, silicones, phthalates, gluten, paraffin, or propylene, the Coconut Curling Cream is gentle enough for daily use. For best results, apply a generous amount to wet or dry hair, section by section. Style as desired. Since the beginning, you’ve pushed us to advance skin and hair science to honor your locs, your curls, your waves, your braids, your natural. At Cantu, we support your journey with care and we celebrate all the styles you rock!', 'https://target.scene7.com/is/image/Target/GUEST_2ae1b256-f2f7-47b5-aa82-bbdffe5774b1', 12.39, 'Beauty', 50.0, 1, 'chanelle');
INSERT INTO "data20220809_printed" VALUES (5, '074108346681', 'Infinti Pro Gold by Conair Soft Bonnet Dryer', 'Why You’ll Love It<br />The InfinitiPro by Conair Soft Bonnet Hair Dryer is perfect for gentle salon performance drying or hot conditioning in the comfort of your own home. Ionic technology provides conditioning ions to reduce frizz and enhance shine and 4 heat/speed settings lets you customize to your hair type and texture. Gently dries your hair and perfect for hot conditioning.<br /><br />Product Details<br />The bonnet is large enough for jumbo rollers and secures around hair with a drawstring. The four foot hose has an easy locking system and stores in its own purse shaped case that stands up for easy, space-saving storage. Bonus hot air vent brush attachment for additional styling. All you need for easy, convenient salon results right at home.  <br /><br />About Conair Haircare<br />When it comes to keeping your look on trend, Conair has you covered. We’ve been doing beautiful things for hair for over 60 years, and we continue to bring you the latest trends and technology. Our full range of professional-quality hair dryers, flat irons, curling irons, curling wands, hair setters, and specialty stylers make it easy to create the looks you love. Bring out the full beauty of your hair with Conair!', 'https://target.scene7.com/is/image/Target/GUEST_c3c685a9-44d4-4063-8223-6f53530496dd', 42.99, 'Beauty', 40.0, 1, 'chanelle');
INSERT INTO "data20220809_printed" VALUES (6, '028208876760', '50ct Outdoor LED Euro String Lights Battery Operated White Wire - Project 62&#8482;', 'Elegant string of Euro LED lights are perfect to light up your interior spaceFeature 50 clear LED bulbs that emit a constant lightTimer function to let you set on and off timeRequire 3 AA alkaline batteries — not included', 'https://target.scene7.com/is/image/Target/GUEST_b5646a3d-e1ba-4a4e-aceb-c684a9438774', 8.0, 'Patio & Garden', 30.0, 1, 'chanelle');
INSERT INTO "data20220809_printed" VALUES (7, '202041306', 'Girls'' 3pk Heart Belt - Cat & Jack™', 'From jeans-and-tee combos to fit-and-flare dresses, your little one will look her best in the Girls'' 3pk Heart Belt from Cat & Jack. They feature hearts with adorable designs to complement her everyday style. Mix and match to create a look she will love. These belts will add a great finishing touch to her outfit.<br /><br />If you’re not satisfied with any Target Owned Brand item, return it within one year with a receipt for an exchange or a refund. ', 'https://target.scene7.com/is/image/Target/GUEST_7e90b497-2359-4bb9-80eb-8c8985777f93', 10.0, 'Clothing, Shoes & Accessories', 70.0, 1, 'chanelle');
INSERT INTO "data20220809_printed" VALUES (8, '068032245', '2pk 42&#34;x36&#34; Light Filtering Honeycomb Curtain Tiers White - Threshold&#8482;', 'Effortlessly update the style and atmosphere of any room in your home with this Tier Curtains from Threshold™. These half-window curtains features a subtle embroidered grid pattern in white on a white cotton-blend fabric for a clean and sophisticated look. With a light-filtering design that lets a little sun through during the day and a rod pocket at the top for easy hanging, you can combine these embroidered white tier curtains with a valance curtain or use them on their own as a way to create a soft, welcoming environment in any room.', 'https://target.scene7.com/is/image/Target/GUEST_96263e79-00b0-4c52-98cb-f1a6e9337e3f', 23.0, 'Home', 50.0, 2, 'chanelle');
