INSERT INTO "data20220809_printed" VALUES (10, '191908525044', 'Dot Towel Pink with SILVADUR™ Antimicrobial Technology - Pillowfort™', 'Add a fun touch of prints to their bath decor with this Pink Dot Towel with SILVADUR™ Antimicrobial Technology from Pillowfort™. This practical hand towel is a must-have addition to their everyday bath linens. It features a white backdrop that''s adorned with soft pink polka dots, along with soft fringes on the edging to bring playful flair to their bathroom. The 100% cotton material with terry weave makes it soft, absorbent and comfortable to use after a bath or shower, while the SILVADUR™ antimicrobial technology controls odor and helps the towel stay fresh longer. Plus, it can be machine washed for easy care.', 'https://target.scene7.com/is/image/Target/GUEST_1a8277cf-8bb9-4467-be40-518301186c71', 8.0, 'Baby', 30.0, 1, 'Chanelle');
