INSERT INTO "data20220809_printed" VALUES (12, '068031349', '1pc Sheer Crinkle Window Curtain Panel White - Room Essentials™', 'Bring a lovely finishing touch to your room decor with the Crinkle Sheer Curtain Panel White from Room Essentials™. This sheer curtain panel allows sunlight to seep through it while still offering privacy and a pretty look in your home. Fashioned in a white hue that makes it easy to coordinate with a variety of decor styles, it features a crinkle finish for a touch of added texture. Plus, it features a classic rod pocket design that makes this light-filtering curtain panel easy to hang.', 'https://target.scene7.com/is/image/Target/GUEST_f11e80ef-19ae-4969-a60d-ea12b6ae9195', 10.0, 'College', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (13, '037000276159', 'Pampers Hybrid Cover Unisex Diapers Jungle, I Heart You-gray, Milk and Cookies - 3ct', 'Curious about cloth diapers, but not sure how to get started? Try the Pampers Pure Protection Hybrid Diaper. Made to use with our Disposable Inserts, Pampers Pure Cloth Diaper Covers are soft, reusable and easy to use. These covers are one-size-fits-most and grow with your baby. Good for baby, good for the planet.', 'https://target.scene7.com/is/image/Target/GUEST_afe4986a-729e-4b0c-b38f-4baacdf13a64', 69.99, 'Baby', 60.0, 1, 'Chanelle');
