INSERT INTO "data20220809_printed" VALUES (16, '077784033746', 'Digital Glass Bathroom Scale with Spa Blue - Taylor', 'Designed with a spa blue glass finish, this scale is stylish and accurate. An 11.8'' x 11.8'' platform is made from durable, tempered glass. The 3.2'' x 1.5'' display makes it easy to view weight readings up to 400 lb. High 400 lb (180 kg) capacity weighing in precise 0.2 lb increments (lb/kg/st).  This scale features instant on, auto off, and a low battery indicator to prevent excessive battery drain.  2 AAA batteries included. Provided in the box are clear instructions, troubleshooting tips and details on the 5 year limited warranty.<br /><br />WE ARE HERE TO HELP:   Taylor Scales are precision instruments and storing or moving the scale can affect the accuracy.  Please refer to the troubleshooting tips included with your scale for continued accurate results or contact our Customer Service department.  We are happy to help!', 'https://target.scene7.com/is/image/Target/GUEST_a1e420d9-6b18-4270-b851-a095c8ff925d', 19.99, 'College', 50.0, 1, 'Chanelle');
