INSERT INTO "data20220809_printed" VALUES (18, '081492039341', 'Suction Long Basket Clear - Room Essentials&#8482;', 'The Long Clear Suction Corner Basket from Room Essentials™ helps you keep your bath essentials organized. This plastic shower caddy can be easily mounted on any wall or hard surface in your shower to offer you space-efficient storage, while the suction cups help secure it to the surface to prevent it from falling down. Great for storing anything from body wash, shampoo and conditioner to face wash or other grooming essentials, it features integrated cutouts to secure your razors, hair brushes or loofahs. Plus, it features a perforated design that prevents water from accumulating by allowing it to drain easily on its own.', 'https://target.scene7.com/is/image/Target/GUEST_77d05abd-b77a-46ce-a35d-078387fa9f57', 15.0, 'Home', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (19, '033991064508', 'Scosche 300A Car Jumper/Power Bank PBJ300', 'This compact vehicle Jump Starter is powerful, safe, and easy to use.<br />The PowerUp 300 Portable Battery Jump Starter is the compact, lightweight answer to emergency situations. Its advanced technology and ample power will jump start a vehicle (up to 6 cylinders and 3.5 liters) quickly and efficiently. It''s versatile and can charge your mobile devices or light you way in the dark with a multi-mode LED flashlight. The PowerUP 300 includes safety protection against short circuit, reverse connection, reverse charge, overheating and overcurrent and overcharging. The 5,400 mAh jump starter is spark-free with a 6-point protection system. It can hold its charge for up to 6 months and comes with a carrying case that easily fits in your glove compartment.', 'https://target.scene7.com/is/image/Target/GUEST_547f40dd-5276-4a67-9df4-4bbfebd7c091', 64.99, 'Home', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (20, '033991047846', 'Scosche Universal Headrest Mount HRMT', 'Open design allows for complete access to all connections and controlsWatch movies, play games and moreClamping arms open up to 7.75” wide to fit larger tabletsMount swivels and secures your iPad in vertical or landscape modeEasily detaches or attaches to the back of your vehicles headrestHigh strength construction safely mounts your iPad or Tablet', 'https://target.scene7.com/is/image/Target/GUEST_c3be3962-85ca-4f6c-9888-86e3e54cab52', 18.29, 'Electronics', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (21, '702992887934', 'Ceramic Table Lamp with Rattan Shade White - Threshold™ designed with Studio McGee', 'Bring decorative appeal to your indoor lighting with this White Ceramic Table Lamp with Rattan Shade from Threshold™ designed with Studio McGee. This white ceramic table lamp makes a great addition to your home decor. It comes with a tapered, drum-shaped rattan shade for natural style that coordinates with a variety of aesthetics. The dimmable light setting allows your to adjust the level of lighting. Place it on any side table, console or sideboard to cast a warm and welcoming glow.<br /><br />Meet Shea McGee, the designer and stylist behind the brand Studio McGee. Founded alongside her husband, Syd, the studio is known for Shea’s design of beautifully elevated spaces that encourage clients to surround themselves with the things and people they love. Now she’s partnering with Threshold to offer Studio McGee’s classic design in a new collection for inspired homes, everywhere.', 'https://target.scene7.com/is/image/Target/GUEST_7c37d6ba-32d0-47e1-9109-cb8f939826e1', 60.0, 'Home', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (22, '702992887934', 'Ceramic Table Lamp with Rattan Shade White - Threshold™ designed with Studio McGee', 'Bring decorative appeal to your indoor lighting with this White Ceramic Table Lamp with Rattan Shade from Threshold™ designed with Studio McGee. This white ceramic table lamp makes a great addition to your home decor. It comes with a tapered, drum-shaped rattan shade for natural style that coordinates with a variety of aesthetics. The dimmable light setting allows your to adjust the level of lighting. Place it on any side table, console or sideboard to cast a warm and welcoming glow.<br /><br />Meet Shea McGee, the designer and stylist behind the brand Studio McGee. Founded alongside her husband, Syd, the studio is known for Shea’s design of beautifully elevated spaces that encourage clients to surround themselves with the things and people they love. Now she’s partnering with Threshold to offer Studio McGee’s classic design in a new collection for inspired homes, everywhere.', 'https://target.scene7.com/is/image/Target/GUEST_7c37d6ba-32d0-47e1-9109-cb8f939826e1', 60.0, 'Home', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (23, '029275017827', 'Lewis N. Clark WaterSeals Waterproof Phone Pouch with Magnetic Seal', 'If you''ve ever wished you could bring your phone to the beach, on a boating trip, or even while snorkeling, this magnetic waterproof phone pouch now gives you that option. Foolproof and fumble-free, the double magnetic closure automatically seals with an audible ''snap'' for watertight protection. You can use your phone as if the pouch wasn''t even there, so you can still listen to music, play a game, and watch a video without the need for a headphone or audio jack. <br /><br />The transparent TPU material also allows you to take crystal clear pictures and videos, even when you''re underwater. You can also put other small items inside, such as credit cards, drivers'' licenses, keys, travel documents, money, memory cards, or other electronics such as MP3 players or cameras. <br /><br />Waterproof up to 100+ feet, the pouch is perfect for all kinds of water sports. It''s also great at the pool, beach, campground, waterpark, and on cruises. It can be used in wintertime recreational activities or even just a rainy or snowy day. Not only does it keep moisture out of the pouch, but it also keeps particles such as sand and dust out as well. The lanyard is adjustable and can be worn around your neck or wrist or attached to an object. Pouch measures 7.2 in x 4.4 in. <br /><br />Before attempting to submerge electronics underwater, read the manufacturer''s recommendations regarding depth limits to make sure that the device can withstand the water pressure.', 'https://target.scene7.com/is/image/Target/GUEST_e7e7c3fe-b4b8-4b18-a0aa-f8fb44af52c9', 19.99, 'Luggage', 40.0, 1, 'Chanelle');
