INSERT INTO "data20220809_printed" VALUES (36, '011381070254', '4pk Atherton Wine Glasses - Threshold™', 'Serve your favorite drink in style to family and friends with these 4-Piece Atherton Wine Glasses from Threshold™. This four-piece set features a clear glass construction showcases your beverage or wine in elegant style and allows for beautiful balance in your hand. They are dishwasher-safe for easy maintenance, helping you spend more time sipping and less time cleaning up.', 'https://target.scene7.com/is/image/Target/GUEST_eab0762b-eff8-41e9-b8e1-25eaa3655de4', 30.0, 'Holiday Shop', 50.0, 1, 'Chanelle');
