INSERT INTO "data20220809_printed" VALUES (38, '200031021', 'Riedel Vivant 12.5oz 4pk White Wine Glasses', 'Raise a glass in style with this 4-Piece White Wine Glass Set from Riedel. Perfectly shaped to highlight the wine''s true aroma, the narrow design delivers the wine to the center of the tongue for a rich experience. This white wine glass set is perfect for entertaining or enjoying a relaxing evening at home.<br /><br />All Riedel glasses are dishwasher safe. If you are washing by hand, wash the glass under warm water (use detergent and rinse the glass carefully). To help avoid scratches, ensure your Riedel glass does not have contact with other glasses or metal. To avoid stains, use soft water. To remove stains, use white vinegar. To polish the glass, use two towels and never hold the glass by the base to polish the bowl as the stem could snap due to mishandling. Avoid storing glasses in the kitchen cabinets next to items with a strong odor, as this can taint the glass and influence the wine’s aroma.<br />Visit our Wine Glass Guide on Riedel.com to identify the right glass for your wine<br />', 'https://target.scene7.com/is/image/Target/GUEST_a4411e2b-8b98-4f61-bfa4-0781cac420cb', 39.99, 'Kitchen & Dining', 45.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (39, '200031021', 'Riedel Vivant 12.5oz 4pk White Wine Glasses', 'Raise a glass in style with this 4-Piece White Wine Glass Set from Riedel. Perfectly shaped to highlight the wine''s true aroma, the narrow design delivers the wine to the center of the tongue for a rich experience. This white wine glass set is perfect for entertaining or enjoying a relaxing evening at home.<br /><br />All Riedel glasses are dishwasher safe. If you are washing by hand, wash the glass under warm water (use detergent and rinse the glass carefully). To help avoid scratches, ensure your Riedel glass does not have contact with other glasses or metal. To avoid stains, use soft water. To remove stains, use white vinegar. To polish the glass, use two towels and never hold the glass by the base to polish the bowl as the stem could snap due to mishandling. Avoid storing glasses in the kitchen cabinets next to items with a strong odor, as this can taint the glass and influence the wine’s aroma.<br />Visit our Wine Glass Guide on Riedel.com to identify the right glass for your wine<br />', 'https://target.scene7.com/is/image/Target/GUEST_a4411e2b-8b98-4f61-bfa4-0781cac420cb', 39.99, 'Kitchen & Dining', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (40, '765942274215', 'Fashion Forms Women''s Water Wear Push-Up Pads', 'These Water Wear Push-Up Pads from Fashion Forms are the perfect way to create shape and give natural lift to your figure. The water bra pads are lightweight and soft to the touch, making them a comfortable solution for all-day wear. You''ll love the instant enhancement you''ll get when inserting the pads into your bra.', 'https://target.scene7.com/is/image/Target/GUEST_a7f19f5b-7a13-4998-aace-47b9f78dc6bf', 8.99, 'Clothing, Shoes & Accessories', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (41, '025725514540', 'Franklin Sports Volleyball Knee Pads - Black', 'Volleyball knee pads help you stay protected on the courtIn black with white ''Franklin'' text for a sleek vibeSimple pull-on design makes for easy wearMade from soft fabric for athletic comfortStrap closure helps you maintain a secure fit', 'https://target.scene7.com/is/image/Target/GUEST_d43265a0-c7f5-4611-b555-bc7759a23a5f', 14.99, 'Sports & Outdoors', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (42, '886798028088', 'CamelBak 32oz Chute Mag Vacuum Insulated Stainless Steel Water Bottle', 'Hydration made simple, the CamelBak Chute Mag vacuum insulated water bottle delivers high flow without the mess. The cap features an easy carry handle and a magnetic top that stows securely out of the way when open and is leak-proof when closed. Universal cap is compatible with Eddy+ and Hot Cap vessels. Double-wall vacuum insulation keeps drinks cold for 24 hours or hot for 6. Strong and durable stainless steel with powder coat finish, easy to clean. Cap assembly is top-rack dishwasher safe (hand wash vessel).<br /><br />CamelBak Got Your Bak™ Guarantee: If we built it, we''ll Bak it™ with our lifetime guarantee.', 'https://target.scene7.com/is/image/Target/GUEST_631cb427-49ad-49c1-91f1-8a8467f18dfc', 34.99, 'Sports & Outdoors', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (43, '200130062', 'Cotton Chambray Round Tablecloth - Threshold™', 'Add a pop of color to your table spread with the Cotton Chambray Round Tablecloth from Threshold™. In a solid hue, this textured tablecloth brings a clean and sleek touch to your tablescape, making it versatile enough to be the centerpiece for both entertaining and family dinners. Made from a lightweight fabric, this solid-hue tablecloth will also help protect your table from spills and damage that can be caused by hot pans or dripping candle wax. Simply spread it across the table, and arrange your decorative pieces and serving dishes for a quick and easy update.', 'https://target.scene7.com/is/image/Target/GUEST_fede9885-ccb0-4d5d-89ca-60c0d6e609a8', 15.0, 'Home', 40.0, 1, 'Chanelle');
