INSERT INTO "data20220809_printed" VALUES (58, '061039581', 'Women''s Bucket Hat - Universal Thread™', '<br />Add a stylish upgrade to your outfit while shading your face from the sun''s rays with the Bucket Hat from Universal Thread™. This cute bucket hat matches easily with just about any outfit and helps your style stay looking cool while offering some protection from the sun''s rays. The lightweight fabric also helps keep your head cool and comfy for all-day comfort and the pull-on style makes for easy on/off. Whether you''re hitting the streets, hanging out by a pool or strolling through a park, this bucket hat will keep your style looking cool under the sun.  ', 'https://target.scene7.com/is/image/Target/GUEST_8cd0aac4-8bfc-47d7-a51d-f7d8e630336e', 15.0, 'Clothing, Shoes & Accessories', 60.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (59, '840111512258', 'Mini Diffuser - DesignWorks Ink', 'Set sail with these refreshing notes of ocean air, clary sage, and frosted woods. Each package includes a 1.5 oz milky blue glass bottle, four wooden reeds, 1.5 oz. fragrance oil, and funnel. Each diffuser is packaged in a giftable tube with gold foil. Flip the reeds for a fragrance refresh!<br /><br />Top Notes: Sea Salt, Sparkling Aldehydes, Citrus Ozone, Eucalyptus<br /><br />Middle Notes: Heliotrope, Jasmine, White Water Accord, Clary Sage   <br /><br />Base Notes: Frosted Woods, Marine, Birchwood, Cedar, Rosemary', 'https://target.scene7.com/is/image/Target/GUEST_84d8d18d-ada6-4aff-8cd7-1969c6d1d0a9', 18.29, 'Beauty', 50.0, 1, 'Chanelle');
