INSERT INTO "data20220809_printed" VALUES (62, '191719138976', 'Simple Modern 12ct Cleaning Tablets for Water Bottles, Tumblers, Travel Mugs and Stainless Steel Drinkware', 'Wash away the tough stains and odors in your stainless steel, glass, or plastic bottles and tumblers. Soak for 15-30 minutes, empty, and rinse and your bottle or tumbler will be as good as new! Our cleaning tablets for water bottles are fragrance and chlorine free.<br />', 'https://target.scene7.com/is/image/Target/GUEST_79809c23-a289-4d1a-8990-be886e447eef', 8.49, 'Household Essentials', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (63, '010086770261', 'Demon Slayer: Kimetsu no Yaiba The Hinokami Chronicles - Nintendo Switch', 'WALK THE PATH OF A DEMON SLAYER<br /><br />In Taisho-era Japan, Tanjiro Kamado''s peaceful life is shattered when he returns home to find his entire family slaughtered by a demon. The only survivor is Nezuko, his little sister who has herself been transformed into a demon. Devastated, Tanjiro sets out to walk the path of a “Demon Slayer” to reverse his sister’s transformation and destroy the demon who threatens all of humanity.<br />A story of a brother and sister, and of man and demon, now begins…<br /><br />UNLEASH YOUR INNER DEMON SLAYER IN THE OFFICIAL GAME OF THE ANIME PHENOMENON<br /><br />Take the mantle of Tanjiro Kamado and his allies to fight back the demon threat and prove your mettle to the Demon Slayer Corps. The captivating stories of the TV series and movie are faithfully captured, and the battles transformed into thrilling arena fights!<br /><br />Product Features:<br />• Exhilarating Arena Battles – Master the multitude of spectacular skills of a wide roster of Demon Slayers—and one demon—to overcome challengers in head-to-head battle, locally and online.<br />• Moving Drama – Take up the sword of Tanjiro Kamado and guide his journey to become a Demon Slayer and restore his sister Nezuko’s lost humanity.<br />• High-intensity Boss Battles – Action and drama reach their peak in specially designed battles against the anime’s memorable demon antagonists.<br />• Breathtaking Visual Style – Demon Slayer’s celebrated art and animation are beautifully recreated to bring players deeper into the world.<br />• Original Anime Voice Cast – The original English and Japanese casts of the anime return to bring their authentic portrayals to the game.', 'https://target.scene7.com/is/image/Target/GUEST_d12b5bdf-90e3-4a23-b67d-06c6b12cf319', 39.99, 'Video Games', 50.0, 1, 'Chanelle');
