INSERT INTO "data20220809_printed" VALUES (65, '705954200864', 'Just Wireless FM Transmitter (3.5mm)  with 2.4A/12W 2-Port USB Car Charger - Black', 'A tech-fueled life requires lots of power. <br /><br />The Just Wireless FM Transmitter with dual USB ports car charger will allow you to listen to music on your car stereo through its included 3.5mm AUX jack. With 12W / 5V of charging power, you can also simultaneously charge your devices in the car quickly. This Wireless FM transmitter comes equipped with two extra USB ports for charging one extra device. Go hands-free to answer an incoming call and talk on your phone through your car stereo speakers while easily switching between incoming calls and your music. <br /><br />Its universally compatible with any device with a 3.5mm audio jack AUX port. <br /><br />Keep one of these with you while you travel and never be without a charge! <br /><br />Just Wireless offers a lifetime warranty on all of our car charging products.', 'https://target.scene7.com/is/image/Target/GUEST_c477be90-f358-45f2-8630-d86ad31b1c92', 8.99, 'Home', 30.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (66, '037000508762', 'Febreze Origins Fade Defy Plug Air Freshener &#38; Odor Eliminator, Ocean, Starter Kit &#38; Oil Refill - 0.87 fl Oz', 'Contains starter kit and (1) Origins scented oil refill for Febreze Fade Defy PLUG Air FreshenerWaterlily, ginger, and hinoki mix together to create the can''t-miss cool ambience of OceanElevate every room with a distinct freshness that lasts 50 days (on low setting)Rethink your home fragrance with a Febreze scent unlike any otherFeatures a low-level indicator light so you know when it''s time to change your refill', 'https://target.scene7.com/is/image/Target/GUEST_2646e6e0-e04c-4af7-a5db-de091a075a08', 6.99, 'Household Essentials', 38.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (67, '9781419749155', 'Diary of a Wimpy Kid: Book 16 - by Jeff Kinney (Hardcover)', '<p/><br></br><p><b>  Book Synopsis </b></p></br></br> As the competition heats up, can Greg keep his head in the game--or will he have to throw in the towel? Find out in <i>Diary of a Wimpy Kid: Book 16, </i> the newest book by #1 international bestselling author Jeff Kinney! <p/><br></br><p><b> About The Author </b></p></br></br> <b>Jeff Kinney</b> is the #1 <i>USA Today, New York Times, </i>and <i>Wall Street Journal</i> bestselling author of the Diary of a Wimpy Kid series and a six-time Nickelodeon Kids'' Choice Award winner for Favorite Book. <i>The Deep End</i>, Book 15, was published in November 2020 and was an instant #1 global bestseller. <i>Diary of an Awesome Friendly Kid: Rowley Jefferson''s Journal </i>was published in April 2019, was an immediate #1 international bestseller, and has remained at the top of the <i>New York Times</i> bestseller list since publication, along with the follow-up book, <i>Rowley Jefferson''s Awesome Friendly Adventure.</i> Jeff has been named one of <i>Time</i> magazine''s 100 Most Influential People in the World and is one of the Top 10 bestselling authors of all time. He is also the creator of Poptropica, which was named one of <i>Time</i>''s 50 Best Websites. He spent his childhood in the Washington, D.C., area and moved to New England in 1995. Jeff lives with his wife and two sons in Massachusetts, where they own a bookstore, An Unlikely Story. ', 'https://target.scene7.com/is/image/Target/GUEST_273f71b0-f281-4c9d-9c45-27cdd62bc62e', 7.49, 'Movies, Music & Books', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (68, '9781419749155', 'Diary of a Wimpy Kid: Book 16 - by Jeff Kinney (Hardcover)', '<p/><br></br><p><b>  Book Synopsis </b></p></br></br> As the competition heats up, can Greg keep his head in the game--or will he have to throw in the towel? Find out in <i>Diary of a Wimpy Kid: Book 16, </i> the newest book by #1 international bestselling author Jeff Kinney! <p/><br></br><p><b> About The Author </b></p></br></br> <b>Jeff Kinney</b> is the #1 <i>USA Today, New York Times, </i>and <i>Wall Street Journal</i> bestselling author of the Diary of a Wimpy Kid series and a six-time Nickelodeon Kids'' Choice Award winner for Favorite Book. <i>The Deep End</i>, Book 15, was published in November 2020 and was an instant #1 global bestseller. <i>Diary of an Awesome Friendly Kid: Rowley Jefferson''s Journal </i>was published in April 2019, was an immediate #1 international bestseller, and has remained at the top of the <i>New York Times</i> bestseller list since publication, along with the follow-up book, <i>Rowley Jefferson''s Awesome Friendly Adventure.</i> Jeff has been named one of <i>Time</i> magazine''s 100 Most Influential People in the World and is one of the Top 10 bestselling authors of all time. He is also the creator of Poptropica, which was named one of <i>Time</i>''s 50 Best Websites. He spent his childhood in the Washington, D.C., area and moved to New England in 1995. Jeff lives with his wife and two sons in Massachusetts, where they own a bookstore, An Unlikely Story. ', 'https://target.scene7.com/is/image/Target/GUEST_273f71b0-f281-4c9d-9c45-27cdd62bc62e', 7.49, 'Movies, Music & Books', 50.0, 1, 'Chanelle');
