INSERT INTO "data20220809_printed" VALUES (70, '035000472175', 'Colgate Optic White Stain Fighter Whitening Toothpaste - Clean Mint - 6oz', 'One 6 oz. tube of Colgate Optic White Stain Fighter Whitening ToothpasteThis stain removal toothpaste contains clinically proven technology to safely remove surface stainsRemoves 6x more surface stains with micro-polishing action (vs. ordinary non whitening toothpaste, after 2 weeks of continued use)Clean mint toothpaste that’s enamel safe for daily useAnticavity fluoride toothpaste helps protect against cavities', 'https://target.scene7.com/is/image/Target/GUEST_4c0cf164-8ca8-4591-b55b-f6333308d651', 4.99, 'Beauty', 30.0, 2, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (71, '765942181711', 'Fashion Forms Women''s Dress Tape With Dispenser', 'Keep your apparels in place and avoid embarrassing slip-ups with this double-sided Women''s Dress Tape With Dispenser from Fashion Forms. To apply, rip off as much as you need and apply to skin. Peel off the paper backing and stick to your clothing. To remove the body tape, simply peel clothing from tape, then remove the tape from your skin. You can rely on this fashion tape to perfect your day and night outfits. It''s fabric friendly, and you can wear them with your lingerie too. From low cut blouses to strapless daywear dresses, now dress up with ease and create your favorite look with this double stick stripe. ', 'https://target.scene7.com/is/image/Target/GUEST_d110c43e-634c-4ed0-b60d-a7240dbfa812', 7.99, 'Clothing, Shoes & Accessories', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (72, '049011568', 'Old Spice Wild Bearglove Scent Invisible Solid Antiperspirant &#38; Deodorant for Men - 2.6oz', 'Old Spice Bearglove is an improved invisible solid antiperspirant and deodorant with the long-lasting scent of crisp apples and successStay sniffworthy with 48-hour sweat and odor protection that goes on invisible and stays feeling dryUnleash the improved triple protection power of reduced sweat, odor protection and lasting scent with Old Spice Men''s Invisible SolidRemember, the ladder of success is slippery unless you''re wearing beargloves', 'https://target.scene7.com/is/image/Target/GUEST_ab3fe1b0-2406-4a4e-9865-9b0db5ebf09b', 5.49, 'Beauty', 30.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (73, '300410107819', 'MYSTIC by Oral-B Kid&#39;s Toothbrush for Children and Toddlers 3+ Soft Bristles - 2ct', 'You will receive 2 MYSTIC by Oral-B Kid''s ToothbrushesIntended for children and toddlers (3+ years)Featuring mystical dragon and unicorn characters that help smiles sparkle!Helps slay bad breath and plaque at the sourceSmall, easy-to-grip handle perfect for smaller hands learning to brushHelps clean hard-to-reach back teethComplete the collection with MYSTIC toothpaste and mouthwash featuring your favorite magical creatures!', 'https://target.scene7.com/is/image/Target/GUEST_c6aa1529-97dc-45a2-9216-b0084aeb35c6', 2.99, 'Beauty', 35.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (74, '671803405967', 'Funko Disney The Proud Family Mini Coin Bag', 'Take your outfit to the louder and prouder level with the <i>The Proud Family: Louder and Prouder</i> Coin Bag. Organize your small accessories and trinkets with this zipper closure pouch. The design features an all-over print of Penny Proud, Dijonay Jones, Zoey Howzer, and LaCienega Boulevardez. This coin bag is made a polyurethane, has a sturdy metal zipper closure, and is approximately 6.5-inches tall x 5-inches wide.', 'https://target.scene7.com/is/image/Target/GUEST_613f82b6-8515-409a-a9fd-539f6868f953', 7.99, 'Toys', 70.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (75, '191908724508', 'Round Ceramic Bud Vase with Flared Rim - Hearth & Hand™ with Magnolia', 'Elevate any table setting with this Round Ceramic Bud Vase with Flared Rim from Hearth & Hand™ with Magnolia. This ceramic bud vase brings decorative style into your home. It features a rounded pot shape with a flared rim for added style. This stylish piece looks beautiful displayed solo or filled with flowers or greenery. Set it atop your mantelpiece, console table, sideboard or shelf with other accent pieces and spot clean when needed.<br /><br />Celebrate the everyday with Hearth & Hand — created exclusively for Target in collaboration with Magnolia, a home and lifestyle brand by Chip & Joanna Gaines. Built upon our shared commitment to giving back to our communities, these pieces reveal the beauty of everyday moments shared with family and friends.', 'https://target.scene7.com/is/image/Target/GUEST_d0f9650a-ff8f-46e2-925d-6742658daacb', 5.99, 'Home', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (76, '196365036645', 'Raffia Hair Clip 2pc - A New Day&#8482;', 'Lift your locks with the natural flair of this 2pk of Raffia Hair Clips from A New Day™. A pair of hair barrettes with pear-shaped cut-out tops and brown woven raffia designs is included in this hair accessory set, and they''re secured with a gold-tone fastening at the back to hold your hair neatly in place. Use these fashion hair clips to style a half-up look, or to hold bangs and other shorter pieces in place before securing them in a ponytail or other updo.<br /><br />A New Day™: Style that goes wherever you do.', 'https://target.scene7.com/is/image/Target/GUEST_214be6ba-2dae-431a-acd8-6ff5363e1c50', 4.25, 'Beauty', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (77, '191904822338', 'Straw Webbing Strap Tote Handbag - Universal Thread&#8482; Natural', 'Whether you''re out at the farmer''s market or shopping at the mall with friends, this Straw Webbing Strap Tote Handbag from Universal Thread™ will add natural flair to your go-to looks. Made with straw in a rectangle shape, this natural tote handbag comes with a webbing strap in blue and white to add a touch of color and cool style to the otherwise simple tote handbag. It comes with an open design for easy access to your belongings. And with the double handles, you can carry this straw tote handbag in convenient style.<br /><br />Universal Thread™: The denim collection that''s true to you.   ', 'https://target.scene7.com/is/image/Target/GUEST_91233244-37a1-4e46-908d-dbfc271b2ec0', 40.0, 'Clothing, Shoes & Accessories', 60.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (78, '671803405967', 'Funko Disney The Proud Family Mini Coin Bag', 'Take your outfit to the louder and prouder level with the <i>The Proud Family: Louder and Prouder</i> Coin Bag. Organize your small accessories and trinkets with this zipper closure pouch. The design features an all-over print of Penny Proud, Dijonay Jones, Zoey Howzer, and LaCienega Boulevardez. This coin bag is made a polyurethane, has a sturdy metal zipper closure, and is approximately 6.5-inches tall x 5-inches wide.', 'https://target.scene7.com/is/image/Target/GUEST_613f82b6-8515-409a-a9fd-539f6868f953', 7.99, 'Toys', 70.0, 1, 'Chanelle');
