INSERT INTO "data20220809_printed" VALUES (80, '818009027702', 'heyday™ Lightning to USB-C Braided Cable', 'Even with an everyday task like charging or syncing your device, you can represent your stylish aesthetic with the Lightning to USB Braided Cable from heyday™. This lightning cable features a braided cord with a metal-wrapped connector that''s durable, strong and easy to slide in and out of your pocket or bag. Compatible with a variety of devices, from all iPhone models to lightning iPad and iPod, you''ll get a lightning-fast data transfer rate whether you''re amping up the charge or syncing files. Plus, the 4-foot cable provides just enough length for you to reach your device whether on your work desk, beside your bed or on the go.<br /><br />hey, you. It''s time to make your day. So take a minute to live out loud, to power your look, and let your style speak volumes.', 'https://target.scene7.com/is/image/Target/GUEST_8834b5b4-72cf-4ace-9b7d-9d90edc38665', 14.99, 'College', 30.0, 1, 'Chanelle');
