INSERT INTO "data20220809_printed" VALUES (82, '080086700', 'heyday™ Lightning to USB-C Braided Cable', 'Even with an everyday task like charging or syncing your device, you can represent your stylish aesthetic with the Lightning to USB Braided Cable from heyday™. This lightning cable features a braided cord with a metal-wrapped connector that''s durable, strong and easy to slide in and out of your pocket or bag. Compatible with a variety of devices, from all iPhone models to lightning iPad and iPod, you''ll get a lightning-fast data transfer rate whether you''re amping up the charge or syncing files. Plus, the 4-foot cable provides just enough length for you to reach your device whether on your work desk, beside your bed or on the go.<br /><br />hey, you. It''s time to make your day. So take a minute to live out loud, to power your look, and let your style speak volumes.', 'https://target.scene7.com/is/image/Target/GUEST_8834b5b4-72cf-4ace-9b7d-9d90edc38665', 14.99, 'Electronics', 30.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (83, '080089351', 'heyday™ Apple iPhone 12/iPhone 12 Pro Silicone Case', 'Keep your iPhone covered while adding lasting style to your accessories with this Apple iPhone Silicone Case from heyday™. In a clean design and rounded corner bumpers for a stylish look, this iPhone case easily slips onto your phone to cover its exterior from everyday use. The smooth port openings and soft side buttons let you operate your phone in hassle-free style, while the silicone design ensures lasting use without being bulky.<br /><br />hey, you. It’s time to make your day. So take a minute to live out loud, to power your look, and let your style speak volumes.', 'https://target.scene7.com/is/image/Target/GUEST_8a5b8088-a290-45e8-9e6b-42ee6e1c2d4e', 19.99, 'Electronics', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (84, '056070048', 'Epson 220 Single, 2pk, 3pk & 4pk Ink Cartridges - Black, Yellow, Magenta, Cyan, Multicolor', 'Epson inks, specialty papers and printers are created to work together to consistently bring you excellent results. Replace only the color you need with individual ink cartridges to print amazing documents and great photos. Epson''s revolutionary DURABrite Ultra Ink produces smudge, fade and water resistant prints that look brilliant on both plain and glossy photo paper.', 'https://target.scene7.com/is/image/Target/GUEST_4006bafc-fe83-4480-982d-5f11c64b1139', 8.99, 'School & Office Supplies', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (85, '840171714098', 'Case-Mate MagSafe Card Holder - Black', 'Slim, compact, secure. Seamlessly integrate the Magnetic Card Holder onto your MagSafe compatible case or iPhone. Hold up to three cards or cash and feel secure with the ultra strong built-in magnets that lock the wallet into place. With its slim silhouette and smooth vegan leather finish, the non-intrusive Magnetic Card Holder becomes like a second skin on your phone.<br /><br />Case-Mate has ensured that every design is built to protect as well as fit into your style. Aside from attention to detail and an eye for design, all Case-Mate cases are all covered under a limited lifetime warranty that you can count on!', 'https://target.scene7.com/is/image/Target/GUEST_5d1a2e75-7eb1-45d8-9ec8-79ae14af9be9', 24.99, 'Electronics', 60.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (86, '885785603857', 'Arrow 10pk Self Drilling Anchor Kit with Screws', 'Putting up pictures, curtains, mirrors and what not has never been easier. These innovative Arrow 10pk Self Drilling Anchor Kit with Screws from Liberty Hardware is ideal for installing mirrors, pictures and even hanging shelves. Made of durable plastic, they’re easy to install and remove as well. What’s more? It requires no pre-drilling.', 'https://target.scene7.com/is/image/Target/GUEST_5490d5e4-d109-4dbf-a833-79fe989bae31', 3.3, 'Home', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (87, '037000096153', 'Secret Clinical Strength Light and Fresh Soft Solid Antiperspirant & Deodorant', 'Did you know heat, activity, and stress can all cause you to sweat, and that stress sweat smells WORSE than other kinds of sweat? Stress sweat comes from a different gland - causing more bacteria and more odor. That''s why Secret Clinical Strength is clinically stress-tested and formulated with 4X the stress-sweat protection* to help stop sweat and odor before they start. It absorbs odor while releasing scent, to keep you smelling clean and feeling dry. Enjoy all-day coverage with Secret Clinical Strength antiperspirant/deodorant  -  incredible protection, no matter what the day may bring. *Vs. the protection required of an ordinary antiperspirant.', 'https://target.scene7.com/is/image/Target/GUEST_6af422e3-1dc3-499f-8b3e-7df4a6d96664', 7.99, 'Beauty', 50.0, 2, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (88, '639428592233', 'JAPONESQUE Lash Curler Midnight', 'The Japonesque® Lash Curler in our Midnight finish delivers up to 8 hours of curl.  The natural arch lifts & curls lashes, creating sweeping lash volume. The ergonomic shape provides the ultimate control to get close to the lash line at a variety of angles & is ideal for deep-set or monolid eyes.  The precision-crafted pivot design applies consistent pressure uniformly curling your lashes.  The soft lash pad creates a long- lasting curl & is gentle enough for both natural & false lashes.', 'https://target.scene7.com/is/image/Target/GUEST_36808890-f489-407e-9a79-ea4d30d81c28', 10.0, 'Beauty', 45.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (89, '764302204213', 'SheaMoisture 100% Virgin Coconut Oil Leave In Conditioner - 8 fl oz', 'SheaMoisture''s 100% Virgin Coconut Oil Daily Hydration Leave-In Conditioner, blended with 100% Virgin Coconut and Shea Oils, creamy Coconut Milk and Acacia Senegal, this conditioner protects and controls frizz for all hair types. Soften hair and improve styling manageability with this lightweight, milk leave-in treatment. It leaves hair wrapped in a light coastal coconut breeze. All SheaMoisture hair products including this leave in hair conditioner are sustainably produced and cruelty-free. This SheaMoisture 100% Virgin Coconut Oil Leave-In, blended with Coconut Oil, Coconut Milk and Acacia Senegal, can be used as a daily conditioner. Generously spray this daily conditioner on clean damp hair focusing on mid-lengths to ends of the hair. Blow or air-dry. SheaMoisture 100% Virgin Coconut Oil Leave-In is formulated with no silicones, no sulfates, no parabens, no phthalates, no mineral oil or petrolatum. It has been tested on family and friends and never on animals. Our Story: SheaMoisture is the legacy of Sofi Tucker, a pioneering mother of four and entrepreneur who sold Shea Butter, African Black Soap and homemade beauty preparations in Sierra Leone in 1912. We honor her vision by continuing to formulate with Raw Shea Butter handcrafted by women in Africa. With every purchase you show support of our mission to reinvest back in our communities.', 'https://target.scene7.com/is/image/Target/GUEST_f37ecf49-e61e-439f-8aa4-746076bc818a', 11.99, 'Beauty', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (90, '850007468033', 'Hero Cosmetics Mighty Acne Pimple Patch Micropoint for Blemishes - 6ct', 'TAKES CONTROL OF EARLY-STAGE ZITS. Loaded with 173 skin-penetrating Micropoints to deliver powerful acne-fighting ingredients right to the core of your pimple. Shrinks blemishes and brings deep, “unpoppable” zits to a head in just 1-2 patches.ACNE-FIGHTING ACTIVES. Pore-unclogging Salicylic Acid, calming Beta Glucan, bacteria-killing Totarol, and super hydrating Hyaluronic Acid work together to clear your pimple from the inside out.BIGGER AND BADDER. Made with 3x more needles than other brands, which means triple the pimple-fighting power per patch. Unique pyramid-shaped micropoints with ultrafine tips make it easy to use and 100% pain-free.SEAMLESS FIT. 18-millimeter dots have enough coverage to take down any size blemish. Made with thin edges and stronger adhesive, so the sticker stays put until the job is done.PREMIUM-GRADE HYDROCOLLOID. Micropoint for Blemishes uses premium-grade hydrocolloid and we never, ever test on animals.', 'https://target.scene7.com/is/image/Target/GUEST_339e416a-e53a-4895-94e9-a3cfe99a11a0', 12.99, 'Beauty', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (91, '812154030617', 'Native Blackberry &#38; Green Tea for Women - 2.65oz', 'If you are planning to switch to an aluminum-free deodorant, then try Native Deodorant with over 15,000 5-Star Reviews. Native deodorant is aluminum-free and contains naturally derived ingredients, with effective long-lasting odor protection.  We believe you should not have to choose between a deodorant that makes you feel safe and a deodorant that works. We never use aluminum, parabens, or sulfates in any of our products. At Native we use both safe, synthetic, sustainable fragrances (free of phthalates) and natural fragrances. Native: Safe. Simple. Effective. ', 'https://target.scene7.com/is/image/Target/GUEST_3d233b7a-8094-4bca-9c12-f1d42b43dc35', 12.99, 'Beauty', 55.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (92, '490080800797', 'AAA Batteries - 20ct - up &#38; up&#8482;', 'Pack of AAA batteries for your everyday home and electronic needs20ct pack of batteries keeps you well stockedKeep on hand to power an array of devicesHolds power up to 10yr for worry-free storage', 'https://target.scene7.com/is/image/Target/GUEST_53ecf867-d779-45da-bf8b-76ad781e8d5b', 8.29, 'Electronics', 30.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (93, '074108392695', 'Conair Double Ceramic Hair Dryer - 1875W', 'Why You’ll Love It<br />The Conair 1875 Watt Double Ceramic Dryer dries hair fast with less damage. It features double ceramic technology for greater heat protection, plus frizz-fighting conditioning ions for healthy-looking shiny style. <br /><br />Product Details<br />Three heat and 2 speed settings provide custom settings for different hair types and the perfect combination to achieve your ideal style. Use the concentrator attachments for smooth, sleek looks. The on-trend matte finish compliments any space. <br /><br />About Conair Haircare<br />When it comes to keeping your look on trend, Conair has you covered. We’ve been doing beautiful things for hair for over 60 years, and we continue to bring you the latest trends and technology. Our full range of professional-quality hair dryers, flat irons, curling irons, curling wands, hair setters, and specialty stylers make it easy to create the looks you love. Bring out the full beauty of your hair with Conair!<br />', 'https://target.scene7.com/is/image/Target/GUEST_b981d58e-1d8d-45b5-b642-124116b9e4a8', 19.99, 'Beauty', 30.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (94, '085019685', 'Holmes 10&#34; 3-Speed Rechargeable Battery Portable Fan - Black', 'No plug? No problem. The Holmes® 10” Rechargeable Fan is on-the-go cooling, thanks to the compact design and rechargeable battery. With three speed settings and lightweight portability, this table fan can tailgate on Saturdays and cool off a camping trip on Sundays. The USB cord makes charging a breeze. The rechargeable battery will last up to three hours on high and up to 8 hours on lowest speed.', 'https://target.scene7.com/is/image/Target/GUEST_a7cb4361-e277-4ebd-8c72-588fc8b38084', 29.99, 'College', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (95, '715418167947', 'green sprouts Snap &#38; Go Easy-Wear Long Sleeve Bibs Popsicles 12-24 Months - Pink', 'green sprouts Snap & Go Easy-Wear Long Sleeve Bib keep your baby clean and dry with full-coverage protection. The soft, waterproof material is comfortable and does not feel like a bib. The unique catch-all pocket flips from back to front to create an extended scoop to easily catch spills and keep food from dropping to the floor. This lightweight coverall bib is perfect for traveling with baby because it neatly rolls up and snaps to store utensils or small snacks in the pocket, and after use keeps messy utensils and bib contained. It is easy to clean for busy moms and dads, and the adjustable hook-and-loop closure allows for easy on and off. Plus, coordinate with other green sprouts feeding items for a perfectly-adorable mealtime.', 'https://target.scene7.com/is/image/Target/GUEST_d6eead0e-653f-4096-961c-cc82bd28383f', 11.99, 'Baby', 30.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (96, '014681027546', 'Neat Solutions Water-Resistant Toddler Short Sleeve Coverall Bib - Carrot', 'Conquer messy mealtimes and beyond!  A fun graphic print enlivens this generously-sized short-sleeve toddler coverall bib.  The lightweight, PVC free water and stain-resistant polyester fabric protects baby''s clothing and makes clean-up a breeze.   Bib features an oversized flip-style crumbcatcher that stays open to catch all those extra messes!  Provides the perfect amount of coverage for toddlers during feeding time, playtime or arts and crafts.  Adjustable easy back closure makes for quick changes and ensures a secure fit.  Machine washable and air dries quickly.  ', 'https://target.scene7.com/is/image/Target/GUEST_0a0538c6-fe66-4362-a797-34ce18e4de83', 5.99, 'Baby', 30.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (97, '195995169754', 'Women''s Straw Panama Hat - Universal Thread™', 'Protect your face from the sun''s rays in fashion and comfort with this Straw Panama Hat from Universal Thread™. The natural woven structure adds a fun texture and breezy look to any outfit. Its lightweight construction provides a comfortable fit for all-day wear and the pull-on style makes it easy to put on or take off. Whether you''re hitting up the beach, going for a hike or wandering around a park, this hat is sure to keep you looking stylish through all your adventures.', 'https://target.scene7.com/is/image/Target/GUEST_b7468af1-db18-4c06-9c93-796beb01d962', 20.0, 'Clothing, Shoes & Accessories', 60.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (98, '195995169990', 'Women''s Packable Paper Straw Floppy Hat - Shade & Shore™', 'Stay elegantly stylish while shading your face from the sun''s rays with the Packable Paper Straw Floppy Hat from Shade & Shore™. This charming hat comes with a woven texture that adds a chic detail and breezy look to any outfit. A lightweight construction provides a comfortable fit for all-day wear and the pull-on style makes it easy to put on or take off. Whether you''re hitting up the beach, going for a hike or wandering around a park, this hat is sure to keep you looking stylish through all your adventures.', 'https://target.scene7.com/is/image/Target/GUEST_b5b58701-f710-481f-b782-d5ac70f94a10', 10.0, 'Clothing, Shoes & Accessories', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (99, '061039536', 'Women''s Straw Boater Hat with Chin Strap - Universal Thread™', 'Look sharp and fresh on your next outdoor adventure while protecting your face from the sun''s rays with the Straw Boater Hat with Chin Strap from Universal Thread™. The simply stylish woven structure adds a fun texture and breezy look to any outfit. A lightweight construction provides a comfortable fit for all-day wear and the pull-on style makes it easy to put on or take off, plus the adjustable chin strap lets you customize the fit. Whether you''re hitting up the beach, going for a hike or wandering around a park, this hat is sure to keep you looking stylish through all your adventures.', 'https://target.scene7.com/is/image/Target/GUEST_c126ba14-ff68-425c-9e38-ce25bff93f32', 24.0, 'Clothing, Shoes & Accessories', 70.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (100, '061039536', 'Women''s Straw Boater Hat with Chin Strap - Universal Thread™', 'Look sharp and fresh on your next outdoor adventure while protecting your face from the sun''s rays with the Straw Boater Hat with Chin Strap from Universal Thread™. The simply stylish woven structure adds a fun texture and breezy look to any outfit. A lightweight construction provides a comfortable fit for all-day wear and the pull-on style makes it easy to put on or take off, plus the adjustable chin strap lets you customize the fit. Whether you''re hitting up the beach, going for a hike or wandering around a park, this hat is sure to keep you looking stylish through all your adventures.', 'https://target.scene7.com/is/image/Target/GUEST_c126ba14-ff68-425c-9e38-ce25bff93f32', 24.0, 'Clothing, Shoes & Accessories', 70.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (101, '810006942934', 'Cantu Kids&#39; Braid Hair Bonnet', 'We know that you care for your kids hair as much as you do your own.  All of Cantu''s kid-friendly products are specially created to spotlight, nurture and nourish fragile coils, curls and waves.  Cantu has a full range of solutions to cleanse, moisturize, treat and style your little one''s hair.   <br /><br />Protect braids of all lengths with Cantu''s new extra-long braid bonnet.   Our bonnet design is easy to use and will protect hair from damage due to dryness.   The adjustable tie adds extra hold to stay on all night.  ', 'https://target.scene7.com/is/image/Target/GUEST_f6480a97-79da-4a45-a821-b63ad4febadc', 4.99, 'Beauty', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (102, '146500029896', 'OFF! Botanicals Mosquito Repellent Lotion - 4oz', 'OFF!® Botanicals® Insect Repellent Lotion effectively repels mosquitoes, black flies, gnats and no-see-umsEffective plant-based formula, contains no added fragrance or dyesFeels good on the skin, not sticky or greasy and the mosquito repellent won’t damage clothing or gearProven to protect from mosquitoes (Every OFF!® brand insect repellent is evaluated to prove it repels mosquitoes when used as directed)Repels mosquitoes that may carry West Nile virus', 'https://target.scene7.com/is/image/Target/GUEST_f11e0bbe-d4c3-4b73-94f3-767d96cc954c', 5.89, 'Patio & Garden', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (103, '854102006275', 'Mielle Organics Brazilian Curly Cocktail Curl Cream - 7.5 oz', 'Every curly-haired girl’s dream is to have soft, defined, frizz-free curls. Mielle Organics’ Curl Cream is your new secret weapon! With a blend of babassu oil, buriti buriti, copaiba oil, and muru muru, this special formula helps your hair absorb and lock in moisture, giving you the definition you want along with the hydration you need. Apply to damp hair from roots to ends. For best results, buy the entire Brazilian Curly Cocktail collection, and follow up your Curl Cream treatment with our Curl Mousse!', 'https://target.scene7.com/is/image/Target/GUEST_ea1c8091-e1e1-4e90-8bc4-f1e8cbbc40ca', 13.99, 'Beauty', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (104, '840111512296', 'Desk Calendar - DesignWorks Ink', 'Brighten up your desk or personal space with this colorful Retro Pastel Desk Calendar! It includes a sturdy cement base and 12 uniquely designed month cards to easily switch out every month. Each design is stamped with gold foil to add just the right amount of sparkle. It provides a stylish and easy at-a-glance look for everyday use!', 'https://target.scene7.com/is/image/Target/GUEST_1702e556-8a71-46c5-9a17-71cc0d31204e', 14.99, 'School & Office Supplies', 67.0, 4, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (105, '5010993911493', 'Disney Villains Urusla Fashion Doll', 'Independent, self-confident, unforgettable, and of course, sinister -- the iconic Villains of Disney films are always fiendishly fashionable. This sinisterly stylish 11-inch Ursula fashion doll features a stunning purple gown with ruffles inspired by ocean waves, plus shoes and a necklace. This doll of the Sea Witch from Disney''s The Little Mermaid comes in a box with secret compartments holding more surprises, making for a super fun unboxing experience. Kids 5 years old and up can look for them using the included decoder and open to find fun accessories hidden inside. Or they can use the decoder to look for hidden images in Ursula''s dress. Look for more Disney Villains fashion dolls featuring characters like Cruella De Vil, the Evil Queen, and Maleficent, too. Each sold separately. Subject to availability.<br /><br />Copyright Disney<br />Hasbro and all related terms are trademarks of Hasbro.<br /><br />•	Includes doll, dress, necklace, trident, cauldron, decoder, and pair of shoes. <br />•	Figure scale: 11 inches<br />•	Ages 5 and up.<br />•	WARNING: CHOKING HAZARD - Small parts. Not for children under 3 years.', 'https://target.scene7.com/is/image/Target/GUEST_13c136d1-9b9f-4210-8cde-17373c6b3216', 15.2, 'Toys', 50.0, 2, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (106, '490911173489', 'Inflatable Pool Lounge Float Rainbow - Sun Squad&#8482;', 'Spend the hot summer days cooling off on top of the water with the comfortable Sun Squad™ Rainbow Inflatable Pool Float. Quick and easy to inflate, this durably constructed mat features a cushioned design with soft, comfortable inflatable pillow. You will be ready to relax all season long with this tropical floaties.', 'https://target.scene7.com/is/image/Target/GUEST_6be5a414-0ff5-42cc-9a46-42224fbda09d', 15.0, 'Toys', 60.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (107, '885561224276', 'Care Bears Funshine 14&#34; Medium Plush', 'The Care Bears are a group of huggable BFFs living that sweet caring life and what better way for you to join in on the fun than with the new Care Bears Funshine Bear Medium Plush.  Funshine Bear is 14'' inches in size, perfect for unlimited bear hugs, and ready for you to take on your adventures of sharing and caring! <br /><br />Collect them all today!<br /><br />BRAND INFORMATION:<br />The Care Bears are back!  Launching this summer, the iconic 80’s brand and original toy collectibles expression is ready to meet a whole new generation of kids!  Featuring the most-beloved Care Bears in all new stylizations, vibrant colors, and with cool features, it will be hard to choose which one to bring home!', 'https://target.scene7.com/is/image/Target/GUEST_14507b9e-7964-4d4c-ae8e-348758b45261', 9.99, 'Toys', 30.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (108, '673419340731', 'LEGO Star Wars Imperial Shuttle Building Toy 75302', 'Fans can play out exciting scenes from the classic Star Wars trilogy with this buildable Imperial Shuttle (75302) model. The elegant design of the shuttle is beautifully recreated in LEGO bricks, with an opening minifigure cockpit, opening main compartment with space for 2 LEGO minifigures, foldable wings for flight and landing mode, plus 2 stud shooters. Between playtime adventures, it makes a cool display piece. This awesome building toy for kids also includes Darth Vader, Imperial Officer and Luke Skywalker LEGO minifigures with lightsabers and a blaster pistol. The LEGO Group has been recreating iconic starships, vehicles, locations and characters from the Star Wars universe since 1999. LEGO Star Wars is now its most successful theme, with fun, creative gift ideas for fans of all ages.', 'https://target.scene7.com/is/image/Target/GUEST_f79561b9-f493-46e7-a7e7-be585a9fa353', 69.99, 'Toys', 40.0, 1, 'jay');
INSERT INTO "data20220809_printed" VALUES (109, '720354264582', 'Metal Nobu Wall Hanging Assorted Circles in Tones Unframed Wall Canvas Blue/Green - StyleCraft', 'Change the look and feel of your home''s interior with a piece of hanging art in the Nobu Hanging Assorted Circles Wall Art. This unique piece is composed of hammered metal discs that are finished in blue, turquoise and green tones. This modern piece is not framed and will make an excellent addition to any wall.', 'https://target.scene7.com/is/image/Target/GUEST_98f4bf05-e044-4598-b5a3-fcd1fedf96c4', 79.99, 'Home', 45.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (110, '889698501156', 'Funko POP! Marvel: Eternals - Sersi (Target Exclusive)', 'The Eternals live hidden among humans but have emerged from hiding to aid mankind. Collect Pop! Sersi to join your Eternals collection and aid the others in your set. Who will this hero face in your Marvel collection? This Target Exclusive POP! is Sersi in her street clothes. Vinyl bobblehead is approximately 4-inches tall.', 'https://target.scene7.com/is/image/Target/GUEST_0b625339-4825-4d90-b79d-6c0f56ca2e14', 9.59, 'Toys', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (111, '5010993786244', 'Play-Doh Kitchen Creations Grill &#39;n Stamp Playset', 'This Play-Doh grill set brings the fun of a family cookout right to your play space! First, make Play-Doh burgers, hot dogs, and pretend chicken wings with the molds on the grill and cutting board. Place them on the toy grill, close the cover, and the built-in inkpad will stamp ''sear'' marks on their cookout creations! Don''t worry - you can still reuse the Play-Doh compound even after stamping it with ink. Kids can also create pretend kabobs with the skewer and lots of other Play-Doh toppings with this kids'' barbecue toy. With 6 Play-Doh modeling compound colors in 2 and 1 ounce cans, little chefs have everything they need for cooking pretend play. This play grill set for kids 3 years and up makes a great birthday gift or surprise for kids who love modeling clay and cooking toys! <br /><br />Hasbro, Play-Doh, and all related properties are trademarks of Hasbro.<br /><br />•	Includes Grill ''n Stamp playset with built-in inkpad, kabob skewer, cutting board book-mold, spatula, 2 plates, fork, knife, and 6 cans of Play-Doh Brand Modeling Compound (net weight 10 ounces/283 grams). <br />Ages 3 years and up <br />•	Ink will stain. <br />•	Compound not intended to be eaten. <br />•	Notice to Parents: Contains Wheat. <br />•	Non-Toxic. Conforms to: ASTM D-4236.<br />•	To clean, allow to dry, then scrape or vacuum. <br />•	Molded results vary depending on child’s age and level of skill.<br />•	Product and colors will vary. ', 'https://target.scene7.com/is/image/Target/GUEST_e148fd42-3b31-4767-ade5-a847f15c3feb', 10.52, 'School & Office Supplies', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (112, '5010993786244', 'Play-Doh Kitchen Creations Grill &#39;n Stamp Playset', 'This Play-Doh grill set brings the fun of a family cookout right to your play space! First, make Play-Doh burgers, hot dogs, and pretend chicken wings with the molds on the grill and cutting board. Place them on the toy grill, close the cover, and the built-in inkpad will stamp ''sear'' marks on their cookout creations! Don''t worry - you can still reuse the Play-Doh compound even after stamping it with ink. Kids can also create pretend kabobs with the skewer and lots of other Play-Doh toppings with this kids'' barbecue toy. With 6 Play-Doh modeling compound colors in 2 and 1 ounce cans, little chefs have everything they need for cooking pretend play. This play grill set for kids 3 years and up makes a great birthday gift or surprise for kids who love modeling clay and cooking toys! <br /><br />Hasbro, Play-Doh, and all related properties are trademarks of Hasbro.<br /><br />•	Includes Grill ''n Stamp playset with built-in inkpad, kabob skewer, cutting board book-mold, spatula, 2 plates, fork, knife, and 6 cans of Play-Doh Brand Modeling Compound (net weight 10 ounces/283 grams). <br />Ages 3 years and up <br />•	Ink will stain. <br />•	Compound not intended to be eaten. <br />•	Notice to Parents: Contains Wheat. <br />•	Non-Toxic. Conforms to: ASTM D-4236.<br />•	To clean, allow to dry, then scrape or vacuum. <br />•	Molded results vary depending on child’s age and level of skill.<br />•	Product and colors will vary. ', 'https://target.scene7.com/is/image/Target/GUEST_e148fd42-3b31-4767-ade5-a847f15c3feb', 10.52, 'School & Office Supplies', 60.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (113, '810038630182', 'easy@Home Digital Basal Thermometer', 'Basal Body Temperature (BBT) is your temperature when you are fully at rest. It is taken immediately upon awakening before any activity. Unlike traditional thermometers, basal body thermometers can measure with increased accuracy to easily detect your fertile window.<br />The BBT temps will likely surge right after ovulation, with 0.4°F-1.0°F or more shift. <br /><br />The Easy@Home EBT-100 Digital Basal Thermometer is sensitive enough to measure subtle changes in body temperature with the high accuracy of ±0.09°F，and only takes about 90 seconds for the reading with proper use. The free Premom app can automatically chart your reading inputs and draw your coverline, a visual tool to help you identify your BBT shift. And with Premom you will have unlimited measurements in the cloud.<br /><br />Note: Users MUST manually enter temperature in the Premom app with this non-bluetooth enable model.<br />', 'https://target.scene7.com/is/image/Target/GUEST_bbed72ca-0265-43e6-97e9-a1122fd93c14', 15.99, 'Health', 65.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (114, '887961989717', 'Masters of the Universe Origins Rise of Evil 2pk (Target Exclusive)', '​Masters  of  the  Universe  is  back  for  a  whole  new  generation  of  fans  and  collectors  with  Masters  of  the  Universe:  Origins.  Enter  the  ever-evil  Keldor  and  his  formidable  enemy/comrade  Kronis!  These  two  thrilling  figures  in  the  Origins  line  honor  classic  MOTU traditions  while  incorporating  exciting  new  design  features.  Skeletor and  Kronis  figures  are  highly  posable  (16  moving  joints!)  and  come  with  swappable  body  parts.  Keldor  features  both  Keldor  and  an  Alcala  Keldor  design.  Collectors  will  be  blown  away  by  the  expert  design  details,  from  the  ''gemstone''  in  Keldor  figure''s  armor  to  the  staff  that''s  powered  up  with  his  infamous  havoc  energy.  This  authentic  Masters  of  the  Universe:  Origins  set  is  a  must-have  collectible  that  aficionados  will  treasure.  Colors  and  decorations  may  vary.<br />', 'https://target.scene7.com/is/image/Target/GUEST_147e027a-709f-4330-9165-c994aad3ced5', 30.49, 'Toys', 65.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (115, '887961989717', 'Masters of the Universe Origins Rise of Evil 2pk (Target Exclusive)', '​Masters  of  the  Universe  is  back  for  a  whole  new  generation  of  fans  and  collectors  with  Masters  of  the  Universe:  Origins.  Enter  the  ever-evil  Keldor  and  his  formidable  enemy/comrade  Kronis!  These  two  thrilling  figures  in  the  Origins  line  honor  classic  MOTU traditions  while  incorporating  exciting  new  design  features.  Skeletor and  Kronis  figures  are  highly  posable  (16  moving  joints!)  and  come  with  swappable  body  parts.  Keldor  features  both  Keldor  and  an  Alcala  Keldor  design.  Collectors  will  be  blown  away  by  the  expert  design  details,  from  the  ''gemstone''  in  Keldor  figure''s  armor  to  the  staff  that''s  powered  up  with  his  infamous  havoc  energy.  This  authentic  Masters  of  the  Universe:  Origins  set  is  a  must-have  collectible  that  aficionados  will  treasure.  Colors  and  decorations  may  vary.<br />', 'https://target.scene7.com/is/image/Target/GUEST_147e027a-709f-4330-9165-c994aad3ced5', 30.49, 'Toys', 65.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (116, '085633070996', 'Magic 8 Ball Classic Fortune-Telling Novelty Toy', 'The original Magic 8 Ball novelty toy has all the answers to your deepest questions!After “asking the ball” a yes or no question, turn the toy upside-down and wait for your answer to be revealed through the windowAnswers range from positive (“It is certain”) to negative (“Don’t count on it”) to neutral (“Ask again later”)It’s the fastest way to seek advice!', 'https://target.scene7.com/is/image/Target/GUEST_b0e08daa-d59d-4b5c-9399-cf5008552bcb', 8.99, 'Toys', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (117, '729747831363', 'Super Sharkpedo Pool Glider - Sun Squad&#8482;', 'Shark glider races across pool for fun in the waterBold and bright shark design in orange with blue tail finsSubmerge and tip to fill with water before launchingGlides up to 40ft underwaterProduct is manufactured using a couple of different types and durometers (measure of material hardness) of plastic', 'https://target.scene7.com/is/image/Target/GUEST_8c4b6062-2748-4eaa-937d-d039f0e972cc', 8.0, 'Toys', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (118, '021853000573', 'Pressman Let''s Go Fishin'' Deluxe Game', 'The Deluxe edition of a well-known and well-loved fishing game that parents will remember playing as kidsFeatures a rotating pond and sea creatures that open and close their mouthsPlayers use mini fishing poles to try to catch the most sea creaturesGameplay helps develop hand-eye coordinationFor 1-6 players, ages 4 and up', 'https://target.scene7.com/is/image/Target/GUEST_85d00a87-8556-4c7d-a2be-a7102e91c6da', 8.99, 'Toys', 35.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (119, '816448027826', 'National Geographic Glow-in-the-Dark Marble Run - 50pc', 'You’ll be amazed as you watch glowing marbles race down the 50-piece National Geographic Glow-in-the-Dark Marble Run! This set comes with 41 construction pieces that fit snugly together, 8 glow-in-the-dark marbles, a storage bag for all your pieces, and a UV light keychain so your marbles shine bright as they zig-zag down the marble run. A full-color learning guide inside teaches about the physics of motion and gravity. There are countless configurations kids can build with this set, meaning play will last for hours and hours!', 'https://target.scene7.com/is/image/Target/GUEST_e7ad6bc5-56eb-4451-abad-fb7dcbbb6596', 24.99, 'School & Office Supplies', 45.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (120, '204060423', 'B. toys Toy Drum Set 7 Instruments - Parum Pum Pum', 'Play your own rhythm and march your own route with the Parum Pum Pum set from B. toys! This colorful kit comes with everything mini musicians need. Turn a child''s musical talents into a critter celebration with a drum, two centipede drumsticks, an ant jingle bell, a caterpillar tambourine, a bee maraca, and an egg shaker. Children can easily play music on-the-go thanks to the handy strap, then pack up the instruments into the drum when the parade is over. Not to mention, playing instruments sparks creativity, develops fine motor skills, and improves hand-eye coordination. Recommended for toddlers 18 months and over.', 'https://target.scene7.com/is/image/Target/GUEST_b0bdcbd8-00c6-40ae-8c54-a58aff2c90f7', 24.99, 'Toys', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (121, '795861111797', 'SwimWays Spring Float Recliner Swim Lounger for Pool or Lake with Hyper-Flate Valve - Blue', 'The perfect sit-up style floating chair for relaxing and socializing with friends, this recliner is ideal for floating at the lake or in the pool!This fabric-covered floating pool chair has a patented inner spring around the outside edge for greater comfort and stability in the waterUnique patent pending Hyper-Flate Valve inflates and deflates your chair faster than ever, no pump needed. Folds flat into 3 compact rings making travel easy.Lay back in the mesh seat and integrated headrest, backrest, and footrest and float into relaxation! The recliner suspend your lower body just below the water''s surface and includes a built-in cup holder to keep your drink close. Measures (when fully inflated) 55 in x 38 in x 15.5 in and supports most adults up to 250 lbs. Recommended for ages 15 and up', 'https://target.scene7.com/is/image/Target/GUEST_bcf5aa6c-654d-41b4-b57b-b424d877e132', 25.59, 'Toys', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (122, '191908123127', 'Wide Ironing Board Cover Black/White - Threshold&#8482;', 'Bring convenience to your daily ironing clothes chores with the Wide Ironing Board Cover from Threshold™. Made from a scorch- and stain-resistant fabric, this printed ironing board cover not only prevents your ironing board from scratches, iron marks and stains, but it also offers a smooth surface for convenient ironing. Designed for wide ironing boards, it features an elastic band with a hook-and-loop closure that ensures it stays safely fastened around your ironing board for lasting use. Featuring an abstract pattern in black and white, it brings sweet style to your space.', 'https://target.scene7.com/is/image/Target/GUEST_a37f3f04-9167-429e-9975-1d66b00f63ab', 18.0, 'Home', 84.0, 3, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (123, '191908123127', 'Wide Ironing Board Cover Black/White - Threshold&#8482;', 'Bring convenience to your daily ironing clothes chores with the Wide Ironing Board Cover from Threshold™. Made from a scorch- and stain-resistant fabric, this printed ironing board cover not only prevents your ironing board from scratches, iron marks and stains, but it also offers a smooth surface for convenient ironing. Designed for wide ironing boards, it features an elastic band with a hook-and-loop closure that ensures it stays safely fastened around your ironing board for lasting use. Featuring an abstract pattern in black and white, it brings sweet style to your space.', 'https://target.scene7.com/is/image/Target/GUEST_a37f3f04-9167-429e-9975-1d66b00f63ab', 18.0, 'Home', 84.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (124, '630509935598', 'Monopoly Super Electronic Banking Game', '''The Monopoly Super Electronic Banking board game features an all in one electronic banking unit, and amps up the excitement with unique rewards! Each player has a bank card that will earn them different rewards for gameplay: roll a certain number, land on a certain space, or purchase a particular property. Players can also choose to fly to any property on the board, and force another player into trading one of their coveted properties. There is no paper money in this game -- the cards and banking unit track each player''s cash. It''s an exciting game as players buy properties, collect rent -- and get rewarded for it! The player with the most money at the end of the game wins.<br /><br />The Hasbro, Hasbro Gaming, Parker Brothers, and Monopoly names and logos, the distinctive design of the gameboard, the four corner squares, the Mr. Monopoly name and character, as well as each of the distinctive elements of the board and playing pieces are trademarks of Hasbro for its property trading game and game equipment.<br /><br />•	Includes gameboard, banking unit, 4 plastic token, 4 bank cards, 16 Title Deed cards, 20 Chance cards, 4 Reference cards, 1 die, and game guide.<br />•	Ages 8 and up<br />•	For 2 to 4 players.<br />•	Requires 3 x 1.5V AAA alkaline batteries. (Batteries not included.)''<br />', 'https://target.scene7.com/is/image/Target/GUEST_bc7399f5-608c-47ee-b374-bb54aaf81c94', 23.49, 'Toys', 70.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (125, '490911103448', '33 Tube with Handles - Sun Squad™', 'Cool off under the sun in comfort and style with this Inflatable Swim Tube with Handles from Sun Squad™. Featuring a classic round silhouette with a seat at the center, this inflatable swim tube lets you float easily on water under the sun. Easy to inflate, it features two side handles for safe and secure lounging. Featuring bright colors, this inflatable swim tube is sure to add a pop of colors to your sunny weather activities.<br /><br />Sun Squad™: Ready for fun.', 'https://target.scene7.com/is/image/Target/GUEST_44bf950f-d74d-4e01-b7d7-ebce5f981d96', 5.0, 'Toys', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (126, '062243420700', 'Our Generation Millie 18&#34; Fashion Doll', '18-inch non-posable dollLong, light blonde hair and unique gray-blue eyesIncludes doll, coat, dress, underwear, headband, and shoesCompatible with most 18-inch dolls (including American Girl)Suggested for ages 3+ (small parts)No batteries required', 'https://target.scene7.com/is/image/Target/GUEST_3499739f-af83-48e5-9533-7adf859d5e54', 25.99, 'Toys', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (127, '778988393628', 'Present Pets - Sparkle Princess', 'All-new breeds of Present Pets have arrived! Present Pets are the only girls gifts that unbox themselves. Waiting inside each Princess Pup themed box is an adorable interactive Yorkie puppy just for you. She is so excited to meet you, she paws her way out of her own gift box! With one of two possible Princess Pups available in every box, you won’t know which Present Pets puppy you’re getting until she unboxes herself. To start the big reveal, unwrap the box’s outer layer and pull the gift tag. The box will start to shake as your regal pup eagerly paws her way out! The front panel pops open, revealing which Present Pets Princess Pup is inside: Mazie or Cici! Each Princess Pup features a blingy tiara and collar, gold details on her ears and paws, expressive eyes, and a soft plush body. She’s so cute! When she reveals herself, your pup will sing a special royal unboxing song! Discover your pet’s playful personality as you bond and play together. She loves to cuddle! Pet her head and she’ll happily give you kisses and sweet coos. Tickle her tummy to get her excited to play! Her tail will wag faster, as she taps and shuffles her paws and lets out the cutest puppy giggle! Your puppy even recognizes when you speak to her! For more fun, each Princess Pup has two themed bark-back games you can play together. In Royal Repeat, speak to your pup and she’ll imitate you in barks! To play Princess Promises, your pup will bark a number of times – bark back the same number of times and win! Featuring over 100 sounds and actions, Present Pets bring to life the true happiness of what it’s like to be surprised with your very own puppy. Present Pets toys for 5 year old girls and up are great gifts for kids and make any gifting occasion extra special. Includes 6 AAA Duracell batteries. Unwrap all of the Present Pets, including Fairy Pups Missy and Blossom (each sold separately) and bring home an unforgettable unboxing experience the whole family will enjoy! Which puppy will you get?<br /><br />• Includes: 1 Present Pet, 1 Unboxing Guide, 1 Instruction Guide', 'https://target.scene7.com/is/image/Target/GUEST_ca5e1cc9-5004-40d0-9c48-e83db1979065', 35.59, 'Toys', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (128, '083052411', 'Deer Plush Dog Toy - L - Boots &#38; Barkley&#8482;', 'Whether used as a cuddly playmate or a fun toy, the Deer Plush Dog Toy from Boots & Barkley™ makes a perfect companion for your furry friend. With oh-so-adorable features and cute animal accents — face, antlers, ears and more — this deer plush dog toy is designed with a soft fill and durable exterior to let your pet cuddle it and toss it around for hours of fun. A perfect playmate for dogs of all sizes, this cuddly deer toy makes an adorable addition to their toy collection.<br /><br />Boots & Barkley™: Loving your pet from head to tail.<br />', 'https://target.scene7.com/is/image/Target/GUEST_69971579-2614-4cc1-916c-b9bcf53d31f9', 9.99, 'Pets', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (129, '771171171157', 'NERF Super Soaker Dunk It Pool Hoops by WowWee', 'Get ready to dunk on your competition with Nerf Super Soaker Dunk It Pool Hoops by WowWee! This all-new basketball set will become your go-to summer game! Beat the heat by playing basketball in the pool, the Nerf Super Soaker Dunk It Pool Hoops float for an added challenge! Plus, this set comes with an unsinkable ball! Throw the unsinkable ball as much as you like, it will never sink! Play basketball with friends or go solo to practice trick shots while the floating base moves for added difficulty. Want a game that stays in place? Set the Nerf Super Soaker Dunk It Pool Hoop on the side of the pool for poolside play! The Nerf Super Soaker Dunk It Pool Hoop is easy to set up and put away, the hoop folds flat so you can store it out of the way when you’re done playing! Fun for ages 6 and over, the Nerf Super Soaker Dunk It Pool Hoop comes with 1 floating basketball set, 1 unsinkable ball, and instruction manual. Product size: 16 x 11.50 x 23 inches.', 'https://target.scene7.com/is/image/Target/GUEST_b4a84c8b-c906-4001-81bd-24df3f46c8f3', 14.99, 'Toys', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (130, '771171171157', 'NERF Super Soaker Dunk It Pool Hoops by WowWee', 'Get ready to dunk on your competition with Nerf Super Soaker Dunk It Pool Hoops by WowWee! This all-new basketball set will become your go-to summer game! Beat the heat by playing basketball in the pool, the Nerf Super Soaker Dunk It Pool Hoops float for an added challenge! Plus, this set comes with an unsinkable ball! Throw the unsinkable ball as much as you like, it will never sink! Play basketball with friends or go solo to practice trick shots while the floating base moves for added difficulty. Want a game that stays in place? Set the Nerf Super Soaker Dunk It Pool Hoop on the side of the pool for poolside play! The Nerf Super Soaker Dunk It Pool Hoop is easy to set up and put away, the hoop folds flat so you can store it out of the way when you’re done playing! Fun for ages 6 and over, the Nerf Super Soaker Dunk It Pool Hoop comes with 1 floating basketball set, 1 unsinkable ball, and instruction manual. Product size: 16 x 11.50 x 23 inches.', 'https://target.scene7.com/is/image/Target/GUEST_b4a84c8b-c906-4001-81bd-24df3f46c8f3', 14.99, 'Toys', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (131, '194735077083', 'UNO Card Game Marvel Ultimate Add-On Pack - Scarlet Witch', '​With UNO Ultimate Marvel Add-On Scarlet Witch Pack, players can swap a new character into the core UNO Ultimate Card Game (sold separately, subject to availability). The Scarlet Witch Pack has an entire deck of UNO Ultimate cards, with graphics and special rules, designed specifically for this Super Hero to play as Scarlet Witch! This pack also includes two collectible Foil Cards that players can collect or use in the game. Makes a great gift for card game lovers and Marvel fans ages 7 years and older. UNO Ultimate Core Card Game is required -- the instructions for how to play UNO Ultimate can be found only in the core version of the game. UNO Ultimate is best played with up to 4 players. Colors and decorations may vary.<br />', 'https://target.scene7.com/is/image/Target/GUEST_1026732b-ab46-4853-9f6c-76614689eae9', 4.19, 'Toys', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (132, '083057472', 'Dog Tennis Ball Toy - 2.5&#34; - 4pk - Boots &#38; Barkley&#8482;', '4pk dog rubber ball toys keeps your furry friend busy for hours on endMulticolored overall brings fun, cheerful vibes to playtimeTextured surface and durable design ensures easy, long-lasting playGreat for chasing, chewing or a game of fetchEach rubber ball toy measures approximately 2.5'' in diameter', 'https://target.scene7.com/is/image/Target/GUEST_1b9d2dc2-741b-4b58-aadb-7dafd0e10e2e', 4.99, 'Pets', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (133, '079346630707', 'Chuckle &#38; Roar Pop It! Color Change Fidget Toy', 'Oh how fun it is to P-O-P! The original never-ending bubble popping game is now available in Color Change. With all the fun and fidget of the original Pop It!® but bigger, Pop It! XL is three times the size of the original! This sensory toy will keep kids occupied for hours. With no pieces or parts, the self-contained durable design is perfect for travel or even just relaxing and stress relieving with some quiet popping time. Each Pop It! XL is unique due to the tie dye making process and may vary from the images provided. Satisfy your fidget fixation with the biggest Pop It! yet!<br />', 'https://target.scene7.com/is/image/Target/GUEST_f9841763-da3a-439b-b004-da6f8987e25e', 7.99, 'Toys', 40.0, 4, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (134, '642470201749', 'Exclusive Home Topper Curtain Rod', 'The Topper decorative curtain rod and finial set features a simple, classic style and traditional design with a matte finish iron rod and coordinating iron button end cap finials. This set will provide a visually balanced appearance for your window treatments. The 1.6'' diameter x 0.7'' long finials will insure that your window curtain panels will remain securely on the rod. The 1'' diameter iron adjustable curtain rod is designed to fit a wide range of window widths, and has a sturdy 25 lb. capacity that will support flowing sheers to thermal blackout panels. The 3.5'' fixed depth projection bracket provides a gracious amount of space for fabrics to drape perfectly. Accommodates window curtain panels and drapes that are designed with various tops, including: rod pocket, pinch pleat, clip rings, grommets, tab top, or hidden back tab top. Provides an attractive accent to every window treatment in your living room, bed room, bathroom, kitchen, and kids room. Installs easily with included hardware and installation instructions. Sturdy, easy clean, no fuss, wipe clean finish will last for lifetime. This window curtain rod and finial set will add the perfect finish accent to any window treatment and adds a refined style to your home decor. ', 'https://target.scene7.com/is/image/Target/GUEST_4af7cfc3-39e1-4d03-a4f3-f3f71ef563da', 18.89, 'Home', 48.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (135, '079346630837', 'Chuckle &#38; Roar Mini POP It! Neon Orange Square', 'Oh how fun it is to P-O-P! The original never-ending bubble popping game is now in Neon Orange! Just hand this little toy to the nearest kid and you''ll be convinced... Pop it is pure magic. This sensory toy will keep kids occupied for hours. With no pieces or parts, the self-contained durable design is perfect for travel or even just relaxing and stress relieving with some quiet popping time.', 'https://target.scene7.com/is/image/Target/GUEST_15641fcc-ae66-4266-bb9e-177eeb579079', 3.99, 'Toys', 30.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (136, '630509993246', 'Hasbro Marvel Spider-Man Super Web Slinger', 'Kids can imagine defending the world like a super hero with this Spider-Man Super Web Slinger inspired by the Marvel Cinematic Universe that includes the newest Spider-Man movie.<br /><br />Pressing a button on the Web Slinger releases web so kids can imagine they are Spider-Man blasting villains and saving the world! Web slinger includes a can of Web fluid but also works with water for twice the webtacular action. Heroes-in-training can imagine protecting the world from evildoers!<br /><br />Copyright 2021 MARVEL.<br />Hasbro and all related terms are trademarks of Hasbro.<br />© 2021 CPII<br /><br /><br />•	Includes: Spider-Man Super Web Slinger, Web Fluid, refillable water cartridge, glove, and instructions.<br />•	Ages 5 and up<br />•	CAUTION: Do not swing, poke or jab at people or animals.<br />•	WARNING: CHOKING HAZARD – Small parts may be generated. Not for children under 3 years.', 'https://target.scene7.com/is/image/Target/GUEST_4280f2bf-f4c6-4972-8cd0-6145b5bb6f9e', 17.99, 'Toys', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (137, '068050230', 'Round Curtain Rod - Room Essentials&#153;', 'Hanging up curtains doesn''t get any easier than with the simple style and functional design of this Tension Rod from Room Essentials™. Made with steel for durability and stability, this metal curtain tension rod has simple curved accents near the flat ends for subtle touch of texture and style. With an adjustable design that helps you get just the right fit in your window and different sizes and finishes to choose from to meet your decor needs perfectly, this metal tension rod is an easy solution for your curtain hanging endeavors.', 'https://target.scene7.com/is/image/Target/GUEST_94cc4656-99d9-4c3b-b785-82cada0e422b', 10.0, 'College', 50.0, 2, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (138, '887961973891', 'Fisher-Price Paradise Pals Dino Clicker Pal', 'Take-along dinosaur activity toy with fun sensory detailsTwist and turn the dino''s legs and head for fun clicking soundsFun textures on dino''s feet and head for little hands to exploreHelps strengthen fine and gross motor skills, and engages baby''s developing sensesFor infants ages 6 months and older', 'https://target.scene7.com/is/image/Target/GUEST_849cc33a-2217-43db-90d7-9575c1b98cb2', 6.99, 'Toys', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (139, '490680710410', 'Faceted Curtain Rod - Project 62&#153;', 'Hang your drapery in a sleek, modern fashion with this Faceted Curtain Rod from Project 62™. This adjustable metal curtain rod features a faceted design for minimalist style, easily complementing anything from dark and heavy blackout curtains to light, linen sheers. It also comes with brackets, finials and mounting hardware for easy installation.<br><br>1962 was a big year. Modernist design hit its peak and moved into homes across the country. And in Minnesota, Target was born — with the revolutionary idea to celebrate design for all. Project 62 embodies this legacy with a collection of modern pieces made for everyday living.', 'https://target.scene7.com/is/image/Target/GUEST_3e002933-401a-42d3-9b32-70a995058033', 22.0, 'Home', 55.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (140, '490680710410', 'Faceted Curtain Rod - Project 62&#153;', 'Hang your drapery in a sleek, modern fashion with this Faceted Curtain Rod from Project 62™. This adjustable metal curtain rod features a faceted design for minimalist style, easily complementing anything from dark and heavy blackout curtains to light, linen sheers. It also comes with brackets, finials and mounting hardware for easy installation.<br><br>1962 was a big year. Modernist design hit its peak and moved into homes across the country. And in Minnesota, Target was born — with the revolutionary idea to celebrate design for all. Project 62 embodies this legacy with a collection of modern pieces made for everyday living.', 'https://target.scene7.com/is/image/Target/GUEST_3e002933-401a-42d3-9b32-70a995058033', 22.0, 'Home', 55.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (141, '068050230', 'Round Curtain Rod - Room Essentials&#153;', 'Hanging up curtains doesn''t get any easier than with the simple style and functional design of this Tension Rod from Room Essentials™. Made with steel for durability and stability, this metal curtain tension rod has simple curved accents near the flat ends for subtle touch of texture and style. With an adjustable design that helps you get just the right fit in your window and different sizes and finishes to choose from to meet your decor needs perfectly, this metal tension rod is an easy solution for your curtain hanging endeavors.', 'https://target.scene7.com/is/image/Target/GUEST_94cc4656-99d9-4c3b-b785-82cada0e422b', 10.0, 'College', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (142, '801310318119', 'Jada Toys Hypercharger Heat 1:16 Twin Pack RC 2017 Ford GT + Lykan Hypersport', 'From the classic American muscle car to modern race marvels, Big Time Muscle 1:16 Radio Control cars by Jada Toys brings American car culture to a smaller scale. Featuring custom styling with a modern flare, these full function radio control cars are not only fun, but they also look great as well! Big Time Muscle 1:16 RC requires 3 AAA batteries for the vehicle and 2 AA batteries for the controller (batteries not included). Big Time Muscle Radio Control cars function at a 2.4 GHz frequency enabling up to 16+ players to play at a range of 100 feet. Each vehicle is authentically licensed by vehicle manufacturers. These cars are suitable for children ages 6+. ', 'https://target.scene7.com/is/image/Target/GUEST_06a8c64c-4525-4c46-befe-a186990c0b3f', 32.99, 'Toys', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (143, '5010993911493', 'Disney Villains Urusla Fashion Doll', 'Independent, self-confident, unforgettable, and of course, sinister -- the iconic Villains of Disney films are always fiendishly fashionable. This sinisterly stylish 11-inch Ursula fashion doll features a stunning purple gown with ruffles inspired by ocean waves, plus shoes and a necklace. This doll of the Sea Witch from Disney''s The Little Mermaid comes in a box with secret compartments holding more surprises, making for a super fun unboxing experience. Kids 5 years old and up can look for them using the included decoder and open to find fun accessories hidden inside. Or they can use the decoder to look for hidden images in Ursula''s dress. Look for more Disney Villains fashion dolls featuring characters like Cruella De Vil, the Evil Queen, and Maleficent, too. Each sold separately. Subject to availability.<br /><br />Copyright Disney<br />Hasbro and all related terms are trademarks of Hasbro.<br /><br />•	Includes doll, dress, necklace, trident, cauldron, decoder, and pair of shoes. <br />•	Figure scale: 11 inches<br />•	Ages 5 and up.<br />•	WARNING: CHOKING HAZARD - Small parts. Not for children under 3 years.', 'https://target.scene7.com/is/image/Target/GUEST_13c136d1-9b9f-4210-8cde-17373c6b3216', 15.2, 'Toys', 40.0, 4, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (144, '787926151695', 'DC Comics 7&#34; Figure Exclusive &#8211; Batman Hazmat Suit with Light Up Logo', 'After witnessing his parents'' deaths at a young age, Bruce Wayne devoted his life to becoming the world’s greatest weapon against crime—Batman! To become the ultimate vigilante, the Dark Knight disciplined his mind and body to reach the pinnacle of mental and physical superiority. Batman has a plan for every occasion as well as high-tech weapons, gadgets, and vehicles to assist him in his pursuit of justice. One such piece of high-tech equipment is his Hazmat Batsuit, built to protect him from a synthetic plague created by Lex Luthor and known as the Amazo Virus. If exposed to the virus, metahumans'' powers will disappear while normal humans will transform into mutated metahumans. But not if Batman can stop it!<br />', 'https://target.scene7.com/is/image/Target/GUEST_8cb893d6-f93d-4c17-afd8-c6bd4a326b42', 22.99, 'Toys', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (145, '690995982759', 'Hyper Cyberspin Motorized LED Flying Disc - Red', 'Cyberspin is a mind-blowing flying spinner toy with built in electric drive mechanism that can perform incredible aerobatic tricks and stunts. It’s simple to play with, and in just a few minutes you too can be a master! Blast to play solo, or challenge a friend to best trick. Cyberspin works great indoors, and awesome on flat surfaces as well. With a Hyper Cyberspin….Anything is possible!', 'https://target.scene7.com/is/image/Target/GUEST_2cbcdb3f-d703-49cb-815e-2c25ae6035a3', 9.99, 'Toys', 30.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (146, '204000260', 'LEGO Architecture San Francisco 21043', 'Recreate the magnificence of San Francisco’s architecture with this awesome 21043 LEGO Architecture Skyline Collection model. This LEGO brick collectible features iconic San Francisco attractions and landmarks, including the city’s famous “painted ladies” buildings, 555 California Street, the Transamerica Pyramid, Salesforce Tower, Coit Tower, Fort Point, Golden Gate Bridge and Alcatraz Island. A blue-tiled baseplate representing the Golden Gate strait and a San Francisco nameplate add the finishing touch to this amazing model. LEGO Architecture Skyline Collection models are perfect for display in the home or office and have been developed for all with an interest in travel, architectural culture, history and design. Each skyline building set is scaled to give an accurate representation of the comparative size of the featured structures, with realistic color depiction.', 'https://target.scene7.com/is/image/Target/GUEST_ed989481-651e-42d0-8115-8ebf4362927a', 49.99, 'Toys', 70.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (147, '191908672878', 'Woven Pom Garland - Threshold&#8482; designed with Studio McGee', 'Refresh any space in your home with the Woven Pom Garland from Threshold™ designed with Studio McGee. This grass garland accent makes a great accessory for decorating your home. Adorned with woven grass poms, it brings a fresh touch of natural texture into your decor. Plus, loops on both side make for easy hanging on any wall space. Display it on your wall, along the mantel or draped across or around a door for a delightful look.<br /><br />Meet Shea McGee, the designer and stylist behind the brand Studio McGee. Founded alongside her husband, Syd, the studio is known for Shea’s design of beautifully elevated spaces that encourage clients to surround themselves with the things and people they love. Now she’s partnering with Threshold to offer Studio McGee’s classic design in a new collection for inspired homes, everywhere.', 'https://target.scene7.com/is/image/Target/GUEST_b96ddc93-85fc-47c2-99c6-75afab7a619e', 15.0, 'Holiday Shop', 67.0, 9, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (148, '079346629008', 'Giant Aqua Draw Door &#38; Floor Doodle Mat with 22 Mess-Free Tools &#8211; Chuckle &#38; Roar', 'All it takes is your creativity and some water! This massive 2’ x 5.5’ Aqua Draw Doodle Mat can hang from your door to save space or be rolled out on the floor. All you need is water to draw on the mat for a no-mess experience, that means more art on the mat and less on the floor. With 22 different drawing tools including brushes, sponges, and stencils there are so many ways to create your masterpiece. Once you''ve filled your entire surface with art, just let it dry and you''re ready to go again. Nurture your inner artist and spark your imagination!', 'https://target.scene7.com/is/image/Target/GUEST_5ae16ebe-993e-410f-a744-65258df37a04', 19.99, 'School & Office Supplies', 35.0, 1, 'Chanelle');
