INSERT INTO "data20220809_printed" VALUES (150, '191908688206', '6.25&#34; Concrete Garden Gnome Gray - Smith &#38; Hawken&#8482;', 'Give your outdoor living area a fun update with this 6-Inch Concrete Garden Gnome from Smith & Hawken™. The gnome is a symbol of good luck and protection, so place this unique version in your outdoor space along with other décor for a beautiful display. Crafted of concrete, its neutral tone with a touch of bronze gives it versatility, and the subtle sculpted features give this gnome an artistic vibe. Combine with the larger concrete gnome and potted plants to complete the look.', 'https://target.scene7.com/is/image/Target/GUEST_09b7306d-b201-49ca-8bf7-b1da6728316b', 15.0, 'Patio & Garden', 74.0, 5, 'Chanelle');
