INSERT INTO "data20220809_printed" VALUES (154, '5010993848232', 'PJ Masks Deluxe Cat-Car', 'It’s time to be a hero! Preschoolers can zoom to the rescue with the PJ Masks Catboy Deluxe Vehicle. This This Cat-Car toy is equipped with spinning Super Cat Stripes inspired by the Disney Junior show! Kids can release and activate the Super Cat Stripes feature by pressing on the spoiler. This ready-for-action set comes with a poseable Catboy action figure that sits in the open cockpit, so kids can play out their favorite moments from the show. Plus, Catboy figure is compatible with Hasbro Hero ID-equipped PJ Masks playsets (each sold separately, subject to availability), which recognize and react to 3-inch PJ Masks figures with lights, sounds, or both. This Catboy car toy makes a fun gift for preschoolers ages 3 and up who love the superhero adventures of Catboy, Owlette, and Gekko.  <br /><br />HASBRO and all related terms are trademarks of Hasbro.<br /><br /><br />•	Includes vehicle and figure.<br />•	Figure scale: 3 inches <br />•	Ages 3 and up<br />•	WARNING: Small parts may be generated. Not for children under 3 years.', 'https://target.scene7.com/is/image/Target/GUEST_fe08df83-cca6-44d1-b02d-0587c2f64498', 10.29, 'Toys', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (155, '035051577409', 'LOL Surprise Dance Machine Car with Exclusive Doll, Surprise Pool, Dance Floor and Magic Blacklight', 'All your B.B.s will be riding in style and ready 2 party with the LOL Surprise 3-in-1 Party Cruiser, surprise pool and dance floor! Have your LOL Surprise dolls and OMG fashion dolls travel in style to attend the loudest parties and concerts across the globe in the 3-in-1 Party Cruiser. This Party Cruiser has enough room to fit 4 OMG fashion dolls! With the 3-in-1 Party Cruiser’s stylish, luxury Rose Gold color and Pink finish, the Party Cruiser is looking fierce for every occasion! This transforming playset is 3-in-1: Car, Surprise Pool and Dance Floor hangout space. Break out the dance floor or remove the roof and fill it to become a pool. that fits LOL Surprise dolls of all sizes! Party time! Also includes 4 black light flashlights for glowing surprises and removable seats. Get out on the dance floor and dance UR heart out! From MGA Entertainment, creators of LOL Surprise dolls, Rainbow High dolls, Na Na Na Surprise dolls, Little Tikes, Poopsie Surprise girls dolls and many other favorite brands. Great gifts for kids.', 'https://target.scene7.com/is/image/Target/GUEST_9f51367b-5911-4cd8-89cd-bcf46a26c6cb', 29.49, 'Toys', 40.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (156, '191908549729', 'Decorative Sculptural Geometric Folded Bowl Cream - Threshold&#8482; designed with Studio McGee', 'Revamp your home decor with this Decorative Sculptural Geometric Folded Bowl from Threshold™ designed with Studio McGee. This decorative bowl is beautifully folded with an asymmetric rim to create an attractive look. Made from terracotta, this cream sculptural bowl features brown speckled-like pattern with a hint of brown for traditional charm. Display this folded bowl in a shelf with curved woven basket and vase for a decorative look in your space. <br /><br />Meet Shea McGee, the designer and stylist behind the brand Studio McGee. Founded alongside her husband, Syd, the studio is known for Shea’s design of beautifully elevated spaces that encourage clients to surround themselves with the things and people they love. Now she’s partnering with Threshold to offer Studio McGee’s classic design in a new collection for inspired homes, everywhere. ', 'https://target.scene7.com/is/image/Target/GUEST_8a93ccaa-64c2-44a9-8c75-d1824431b236', 35.0, 'Home', 60.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (157, '824968717912', 'Ticket To Ride Board Game', 'Set out on an epic journey building railways across the country in the Ticket To Ride Board Game. Players use strategy and decision-making as they run trains and decide routes between iconic cities. Players draw Destination Ticket cards, put down the train pieces and try to collect the maximum points to win.', 'https://target.scene7.com/is/image/Target/GUEST_50038364-d5ad-45b5-bde1-e92be21a39be', 47.99, 'Toys', 50.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (158, '195166156590', 'Sorry! Sliders Board Game', 'Slide, collide and score to win! In the Sorry! Sliders board game, players each get 4 Sorry Sliders pawns that roll. Players take turns sliding and aiming their pawns towards the gameboard target in an attempt to score the most points. With this family board game, players will have a blast saying “Sorry!” as they knock into opponents and try to score. It’s a race to be the first player to get all 4 scoring pawns to home base on the score tracker to win. Using the gameboards and unit sections, create 4 different game modes, such as Race for Home, Danger Dots, Instant Home and Instant Sorry! All 4 games modes can even be played solo -- set up a favorite and see how many rounds it takes to move all the scoring pawns home. This is a fun game for adults and kids ages 6 and up, and it''s a great choice for a family game night.<br /><br />Hasbro Gaming and all related trademarks and logos are trademarks of Hasbro, Inc.<br /><br />•	Includes 2 gameboards, 4 slider tracks, 8 side rails, 4 blocker rails, 4 score trackers, 16 scoring pawns and 16 Sorry Sliders pawns.<br /><br />•	Ages 6 and up<br />•	For 2 to 4 players.', 'https://target.scene7.com/is/image/Target/GUEST_b7aa7de7-509f-43bf-a0fc-820e7defdf70', 21.99, 'Toys', 30.0, 1, 'Chanelle');
INSERT INTO "data20220809_printed" VALUES (159, '200050604', '10.5 Plastic Dinner Plate - Room Essentials™', 'From family barbecue lunches in the backyard to everyday meals, update your casual dining with the Plastic Dinner Plate from Room Essentials™. Featuring a classic round shape, this microwave-safe (re-heat only) dinner plate is great for serving a variety of main course dishes, while the slightly raised rim protects your clothes and table from spillover or stains. Crafted from BPA-free plastic that makes it durable enough for daily meals, this round dinner plate can be used to re-heat food in the microwave for your convenience. Plus, the dishwasher-safe design makes cleanup a breeze. ', 'https://target.scene7.com/is/image/Target/GUEST_8a7a123e-8c72-4af0-ae54-ec3934107e78', 0.75, 'College', 70.0, 3, 'Chanelle');
